ввода электронной почты','Send link button label'=>'Этикетка кнопки отправки ссылки','<p>Your form has been saved as draft and a resume link has been generated so you can return to the form anytime within {retention_period} days from today. Copy and save the link or enter your email address below to have the link sent to your mail.</p><p>These fields weren\'t saved to your submission draft: Paypal, Stripe, Signature, Password, Captcha, and Upload. Kindly fill them out before submitting the form.</p>'=>'<p>Ваша форма была сохранена как черновик, и была создана ссылка для возобновления, чтобы вы могли вернуться к форме в любое время в течение {retention_period} дней с сегодняшнего дня. Скопируйте и сохраните ссылку или введите свой адрес электронной почты ниже, чтобы ссылка была отправлена на вашу почту.</p><p>Эти поля не были сохранены в черновике вашей заявки: Paypal, Stripe, Signature, Password, Captcha и Upload. . Пожалуйста, заполните их перед отправкой формы.</p>','E.g., johndoe@gmail.com'=>'Напр.: johndoe@gmail.com','Public'=>'Публичное','Nonce verification failed.'=>'Не удалось выполнить проверку nonce.','Set up a friendly name for this integration, so you can easily identify it.'=>'Настройте понятное имя для этой интеграции, чтобы вы могли легко идентифицировать ее.','Save and Continue'=>'Сохранить и продолжить','We\'ve noticed you have updated to Forminator Pro version %s. Please ensure you also update your Forminator Stripe Subscriptions Add-on to version 1.0.4 or higher to ensure compatibility with the new submissions processes.'=>'Мы заметили, что вы обновились до версии Forminator Pro %s. Пожалуйста, убедитесь, что вы также обновили надстройку подписки на Forminator Stripe до версии 1.0.4 или выше, чтобы обеспечить совместимость с новыми процессами отправки.','Your code has been sent to your email.'=>'Ваш код был отправлен на вашу электронную почту.','Having problems? Try another way to log in'=>'Возникли проблемы? Попробуйте другой способ входа в систему','Please try again.'=>'Попробуйте ещё раз.','At least one of Title, Content, or Excerpt must be enabled for post data to be submitted.'=>'Для отправки данных публикации должен быть включен хотя бы один из заголовков, содержания или выдержки.','Store Submissions in Database'=>'Хранить материалы в базе данных','Disable this feature to prevent submissions from being stored in your database. Note that any submissions previously stored in the database will be retained and automatically deleted according to the retention schedule configured in the Privacy settings below.'=>'Отключите эту функцию, чтобы предотвратить сохранение отправленных данных в вашей базе данных. Обратите внимание, что все материалы, ранее сохраненные в базе данных, будут сохранены и автоматически удалены в соответствии с графиком хранения, настроенным в настройках конфиденциальности ниже.','Format%s %s %s'=>'Формат%s %s %s','Property does not exist'=>'Собственность не существует','Please input valid API Key'=>'Пожалуйста, введите действительный ключ API','Markdown supported for card description. Find complete guide %shere%s.'=>'Поддерживается уценка для описания карты. Найдите полное руководство %shere%s.','Your Trello account is already authorized. Edit info below to re-authorize.'=>'Ваша учетная запись Trello уже авторизована. Отредактируйте информацию ниже, чтобы выполнить повторную авторизацию.','Is greater than'=>'Больше , чем','Is less than'=>'Это меньше, чем','Set Up %1$s'=>'Настройка %1$s','Default Preset'=>'Предустановка по умолчанию','Create Preset'=>'Создание пресета','Enter a name for your new preset below.'=>'Введите имя для вашего нового пресета ниже.','Import style from form (Optional)'=>'Импорт стиля из формы (необязательно)','Creating...'=>'Создание...','Preset Name'=>'Имя предустановки','E.g., New preset'=>'Например, Новая предустановка','New Preset'=>'Новый пресет','Delete Preset'=>'Удалить предустановку','Are you sure you want to delete this preset?'=>'Вы уверены, что хотите уда