65 and Above'=>'До 1 года 1-17 18-24 25-34 35-44 45-54 55-64 65 и старше','Applying preset...'=>'Применение предустановки...','Close this dialog'=>'Закройте это диалоговое окно','Delete Answer'=>'Удалить ответ','Deleting this answer will remove its value from the existing submissions as well.'=>'Удаление этого ответа также приведет к удалению его значения из существующих отправлений.','Forminator image'=>'Изображение Forminator','Re-Authorize'=>'Повторная авторизация','Waiting...'=>'Ожидание...','Apply Preset'=>'Применить предустановку','Preset successfully applied to %d form(s).'=>'Предустановка успешно применена к форме (формам) %d.','Preset Name is empty.'=>'Имя предустановки пустое.','Preset ID is empty.'=>'Идентификатор предустановки пуст.','Preset ID is incorrect.'=>'Неверный идентификатор предустановки.','Appearance preset id doesn\'t exist'=>'Идентификатор предустановки внешнего вида не существует','The preset has been successfully updated.'=>'Предустановка была успешно обновлена.','The selected preset has been successfully deleted.'=>'Выбранная предустановка была успешно удалена.','Captcha Provider'=>'Поставщик Капчи','Appearance preset successfully applied.'=>'Предустановка внешнего вида успешно применена.','Something went wrong. Please try again.'=>'Что-то пошло не так. Попробуйте еще раз.','Choose Preset'=>'Выберите Предустановку','Select an appearance preset from the list below to apply the appearance to the selected form(s)'=>'Выберите предустановленный внешний вид из списка ниже, чтобы применить внешний вид к выбранной форме (формам).','The current appearance configurations will be overwritten for the selected form(s).'=>'Текущие конфигурации внешнего вида будут перезаписаны для выбранной формы (форм).','Try Again'=>'Попробовать ещё раз','Please select a field'=>'Пожалуйста, выберите поле','You can open your current Spreadsheet %shere%s.'=>'Вы можете открыть свою текущую электронную таблицу %shere%s.','Choose Audience'=>'Выберите Аудиторию','Please note that changing your API Key or disconnecting this integration will affect ALL of your connected forms.'=>'Пожалуйста, обратите внимание, что изменение вашего ключа API или отключение этой интеграции повлияет на ВСЕ ваши подключенные формы.','Waiting'=>'В ожидании','Captcha verification failed. Please try again.'=>'Проверка Captcha не удалась. Попробуйте еще раз.','Submission Time (hh:mm:ss am/pm, timezone)'=>'Время отправки (чч: мм: ss am / pm, часовой пояс)','hCaptcha. Enabled when you added hCaptcha on your forms.'=>'hCaptcha. Включено, когда вы добавили hCaptcha в свои формы.','Choose a form'=>'Выберите форму','This site is protected by hCaptcha and its %1$sPrivacy Policy%2$s and %3$sTerms of Service%4$s apply.'=>'Этот сайт защищен hCaptcha, и его %1$sПолитика конфиденциальности%2$s и %3$sУсловия использования%4$s применяются.','If you see any errors in the preview, make sure the keys you’ve entered are valid, and you’ve listed your domain name while generating the keys.'=>'Если вы видите какие-либо ошибки в предварительном просмотре, убедитесь, что введенные вами ключи действительны, и вы указали свое доменное имя при создании ключей.','Captcha'=>'Капча','hCAPTCHA Preview'=>'Предварительный просмотр hCAPTCHA','Enter your hCaptcha API keys below to enable hCaptcha option in your form’s CAPTCHA field. See %1$sinstructions%2$s on how to get your API Keys.'=>'Введите свои API-ключи hCaptcha ниже, чтобы включить опцию hCaptcha в поле CAPTCHA вашей формы. См. %1$sinstructions%2$s о том, как получить ваши ключи API.','Hcaptcha'=>'Hcaptcha','hCaptcha API Keys'=>'API ключи hCaptcha','reCaptcha API Keys'=>'API ключи reCaptcha','Forminator currently supports both reCAPTCHA and hCaptcha. Select and configure your preferred CAPTCHA settings and language.'=>'В настоящее время Forminator поддерживает как reCAPTCHA, так и hCaptcha. Выберите и настройте предпочитаемые параметры и язык CAPTCHA.','Recaptcha'=>'Рекапча','Configuration'=>'Конфигурация','A CAPTCHA is an anti-spam technique which helps to protect your website from spam and abuse.'=>'CAPTCHA - это метод защиты от спама, который помогает защитить ваш сайт от спама и злоупотреблений.','hCaptcha type'=>'Тип hCaptcha','hCaptcha offers two different types of CAPTCHA challenges, a Checkbox and an Invisible type. Choose the hCaptcha type you want to use in your form.'=>'hCaptcha предлагает два разных типа вызовов CAPTCHA: флажок и Невидимый тип. Выберите тип hCaptcha, который вы хотите использовать в своей форме.','To comply with online privacy laws, users should be informed that this form includes an invisible CAPTCHA field.'=>'Чтобы соблюдать законы о конфиденциальности в Интернете, пользователи должны быть проинформированы о том, что эта форма содержит невидимое поле CAPTCHA.','By default, the global CAPTCHA language setting will be used. However, you can manually select a different language here.'=>'По умолчанию будет использоваться глобальная настройка языка CAPTCHA. Однако здесь вы можете вручную выбрать другой язык.','Choose the error message you want to display on your form when hCaptcha verification fails.'=>'Выберите сообщение об ошибке, которое вы хотите отобразить в своей форме при сбое проверки hCaptcha.','data if'=>'данные , если','of the conditions below are met.'=>'все нижеприведенные условия соблюдены.','Use conditional logic to send data to this app based on submitted form data.'=>'Используйте условную логику для отправки данных в это приложение на основе отправленных данных формы.','Add conditions under which data should be sent to this app.'=>'Добавьте условия, при которых данные должны быть отправлены в это приложение.','After Submission'=>'После представления','Only used to identify this behavior, and not displayed to users.'=>'Используется только для определения этого поведения и не отображается пользователям.','E.g., Inline Message'=>'Например, встроенное сообщение','Display an inline success message to the user after the form is submitted.'=>'Отобразите встроенное сообщение об успешном завершении для пользователя после отправки формы.','Hide the form after submission, and display a success message to the user.'=>'Скройте форму после отправки и отобразите пользователю сообщение об успешном завершении.','hCaptcha'=>'hCaptcha','You’ll need to configure conditional logic for each submission behavior to ensure Forminator knows when each behavior should be processed. If no conditions have been set, the first submission behavior will be processed.'=>'Вам нужно будет настроить условную логику для каждого поведения отправки, чтобы гарантировать, что Forminator знает, когда каждое поведение должно быть обработано. Если условия не были заданы, будет обработано первое поведение отправки.','hCaptcha verification failed. Please try again.'=>'Сбой проверки hCaptcha. Попробуйте еще раз.','Select your preferred CAPTCHA provider below.'=>'Выберите предпочитаемого вами поставщика КАПЧИ ниже.','reCAPTCHA'=>'reCAPTCHA','Save your API keys to load the hCAPTCHA preview.'=>'Сохраните свои ключи API для загрузки предварительного просмотра hCAPTCHA.','Behavior'=>'Поведение','Process behavior if'=>'Поведение процесса, если','Edit Behavior'=>'Изменить поведение','Add Behavior'=>'Добавить поведение','Process behavior if '=>'Поведение процесса, если ','of the conditions below match.'=>'все приведенные ниже условия совпадают.','Add conditions for when this behavior will be processed.'=>'Добавьте условия для того, когда это поведение будет обработано.','Add Condition'=>'Добавить условие','Configure what should happen when a user submits this form.'=>'Настройте, что должно происходить, когда пользователь отправляет эту форму.','Choose what happens after successful submission of this form. Multiple submission behaviors can be added and conditionally processed based on submitted form data.'=>'Выберите, что произойдет после успешной отправки этой формы. Несколько вариантов поведения при отправке могут быть добавлены и условно обработаны на основе отправленных данных формы.','When handling an %1$saccount erasure request%2$s that contains an email associated with a submission, what do you want to do?'=>'Что вы хотите сделать при обработке запроса на удаление%1$saccount%2$s, который содержит электронное письмо, связанное с отправкой?','Consent'=>'Согласие','checked'=>'проверено','Disable Funding Sources'=>'Отключить источники финансирования','PayPal automatically adds additional funding sources to the PayPal checkout for visitors from supported countries. However, you can choose to disable funding sources which shouldn\'t be displayed to visitors.'=>'PayPal автоматически добавляет дополнительные источники финансирования в платежную систему PayPal для посетителей из поддерживаемых стран. Однако вы можете отключить источники финансирования, которые не должны отображаться посетителям.','Credit or debit cards'=>'Кредитные или дебетовые карты','PayPal Credit'=>'Кредит PayPal','Bancontact'=>'Банковский контакт','BLIK'=>'БЛИК','eps'=>'эпс','giropay'=>'гиропай','Mercado Pago'=>'Mercado Pago','MyBank'=>'Мой банк','Przelewy24'=>'Przelewy24','SEPA-Lastschrift'=>'SEPA-Lastschrift','Sofort'=>'Sofort','Venmo'=>'Венмо','Pre-fill Billing Details'=>'Предварительно заполните платежные данные','Pre-fill the payer\'s billing info collected on your form on the Debit or Credit Card checkout, so the payer doesn\'t have to enter those details again.'=>'Предварительно заполните платежную информацию плательщика, полученную в вашей форме при оформлении заказа по дебетовой или кредитной карте, чтобы плательщику не пришлось вводить эти данные снова.','Shipping Address'=>'Адрес доставки','If you are selling a product that doesn\'t need to be shipped, you can choose to disable and hide the shipping address fields from the PayPal payment page.'=>'Если вы продаете товар, который не нужно отправлять, вы можете отключить и скрыть поля адреса доставки на странице оплаты PayPal.','iDEAL'=>'iDEAL','You can optionally opt-in the subscribers into your Mailchimp’s audience permissions. Choose the GDPR permissions to opt-in your subscribers.'=>'При желании вы можете указать подписчиков в разрешениях аудитории вашего Mailchimp. Выберите разрешения GDPR для регистрации ваших подписчиков.','Select Interest(s)'=>'Выберите Интерес (интересы)','Start typing to add tags'=>'Начните вводить текст, чтобы добавить теги','Group category'=>'Категория группы','Select group category'=>'Выберите категорию группы','Select a group category to see more options.'=>'Выберите категорию группы, чтобы просмотреть дополнительные параметры.','GDPR permissions'=>'Разрешения GDPR','E.g. Consent'=>'Например, Согласие','Describe what your users should consent to.'=>'Опишите, на что должны согласиться ваши пользователи.','Identifier'=>'Идентификатор','E.g., Business Account'=>'Например, Бизнес-счет','Helps distinguish between integrations if connecting to the same third-party app with multiple accounts.'=>'Помогает различать интеграции при подключении к одному стороннему приложению с несколькими учетными записями.','Re-authorize'=>'Повторная авторизация','Mailchimp Tags'=>'Теги Mailchimp','Mailchimp tags help you organize your audience. You can add as many tags as you’d like to your form subscribers.'=>'Теги Mailchimp помогут вам организовать вашу аудиторию. Вы можете добавить столько тегов, сколько захотите, к своим подписчикам формы.','Mailchimp Groups'=>'Группы Mailchimp','Mailchimp groups allow you to categorize your audience based on their interests. Use the options below to group your audience based on submitted form data.'=>'Группы Mailchimp позволяют вам классифицировать вашу аудиторию на основе их интересов. Используйте приведенные ниже параметры, чтобы сгруппировать свою аудиторию на основе предоставленных данных формы.','Mailchimp GDPR Permissions'=>'Разрешения Mailchimp GDPR','Choose audience'=>'Выберите аудиторию','field is required.'=>'поле обязательно для заполнения.','Month field is required.'=>'Поле Месяц является обязательным для запо