d not handle it.'=>'Неожиданный поступок, мы не смогли с ним справиться.','Are you sure you want to deactivate this Add-on?'=>'Вы уверены, что хотите деактивировать это дополнение?','Deactivate Anyway'=>'Деактивировать в любом случае','E.g., \'Arial\', sans-serif'=>'Например, "Ариал", без засечек','Forminator Add-ons'=>'Дополнения Forminator','New update available for one or more Add-ons.'=>'Новое обновление доступно для одного или нескольких дополнений.','A new update is available for one or more of your Forminator Add-ons. Click on the button below to check and update the required Add-on.'=>'Новое обновление доступно для одного или нескольких ваших дополнений Forminator. Нажмите на кнопку ниже, чтобы проверить и обновить необходимое дополнение.','View and Update'=>'Просмотр и обновление','Choose form field'=>'Выберите поле формы','Enter an amount or choose a form field.'=>'Введите сумму или выберите поле формы.','Choose the currency your users will be charged in.'=>'Выберите валюту, в которой будут взиматься платежи с ваших пользователей.','Payment Plan'=>'План оплаты','Payment plans let you set up options for accepting payments on your site. You can add multiple plans and conditionally process them based on your form data.'=>'Планы платежей позволяют настроить параметры приема платежей на вашем сайте. Вы можете добавить несколько планов и условно обработать их на основе данных вашей формы.','Note: You\'ll need to configure conditions on each plan to let Forminator know when to process each of the payment plans below.'=>'Примечание: Вам нужно будет настроить условия для каждого плана, чтобы Forminator знал, когда обрабатывать каждый из приведенных ниже планов платежей.','There is an error in one or more of your payment plans. Please review the error and try again.'=>'В одном или нескольких ваших платежных планах допущена ошибка. Пожалуйста, проверьте ошибку и повторите попытку.','The Stripe Subscription Add-ons is required to use this feature. Install it from the 