(used in Profiles) below. You can assign a form field to multiple meta keys. If you assign a non-required form field to a required user meta, that form field will automatically become required in your form.'=>'Назначьте поля формы метаключам пользователя WordPress по умолчанию (используемым в профилях) ниже. Вы можете назначить поле формы нескольким мета-ключам. Если вы назначите необязательное поле формы требуемой мете пользователя, это поле формы автоматически станет обязательным в вашей форме.','Auto Generated Password'=>'Автоматически Сгенерированный пароль','No custom user meta created yet. Click on "+ Add Custom User Meta" to create custom user meta and map form fields to it.'=>'Пользовательская пользовательская мета еще не создана. Нажмите на "+ Добавить пользовательскую пользовательскую мету", чтобы создать пользовательскую пользовательскую мету и сопоставить с ней поля формы.','Custom User Meta'=>'Пользовательская пользовательская Мета','Create custom user meta keys and assign your form fields to them to set additional user meta keys upon successful user registration.'=>'Создайте пользовательские пользовательские мета-ключи и назначьте им поля формы, чтобы установить дополнительные пользовательские мета-ключи после успешной регистрации пользователя.','Add Custom User Meta'=>'Добавить Пользовательскую пользовательскую мету','Choose whether to allow site registrations on your multisite network and different related settings.'=>'Выберите, следует ли разрешать регистрацию сайтов в вашей многоузловой сети, а также различные связанные с этим настройки.','Assign form fields to the default WordPress site meta keys below.'=>'Назначьте поля формы мета-ключам сайта WordPress по умолчанию, приведенным ниже.','Site Role'=>'Роль сайта','Delete meta'=>'Удалить мету','Confirm Password error message'=>'Сообщение об ошибке подтверждения пароля','Enter confirm password message'=>'Введите сообщение о подтверждении пароля','Columns per row'=>'Столбцы в строке','Customize your quiz layout by adjusting the answers layout and overall quiz alignment.'=>'Настройте свой макет теста, изменив макет ответов и общее выравнивание теста.','Choose whether the quiz answers should appear in a list or a grid.'=>'Выберите, должны ли ответы на вопросы теста отображаться в виде списка или сетки.','Choose the number of columns to fit in one row. Note that grid layout changes to list on smaller screens so this won\'t affect the smaller screens.'=>'Выберите количество столбцов, которое должно поместиться в одной строке. Обратите внимание, что макет сетки изменяется на список на меньших экранах, поэтому это не повлияет на меньшие экраны.','Quiz Alignment'=>'Выравнивание теста','Choose the overall alignment of your quiz. This setting affects everything, including title, description, questions and answers, buttons, and social share message.'=>'Выберите общий формат вашего теста. Этот параметр влияет на все, включая заголовок, описание, вопросы и ответы, кнопки и сообщение в социальной сети.','Customize the quiz container as per your liking.'=>'Настройте контейнер для викторины по своему вкусу.','By default the quiz will fill the available space where you insert it. You can add some padding here to better suit your theme.'=>'По умолчанию тест заполнит все свободное место, куда вы его вставите. Вы можете добавить сюда немного отступов, чтобы они лучше соответствовали вашей теме.','Add an optional border around the quiz.'=>'Добавьте необязательную рамку вокруг теста.','Choose how much spacing you want between each quiz question.'=>'Выберите, сколько интервалов вы хотите сделать между каждым вопросом викторины.','Choose the maximum container width for your quiz. Full Width means quiz container will fill the 100% available space where you insert it, and the Custom option lets you define a maximum container width.'=>'Выберите максимальную ширину контейнера для вашего теста. Полная ширина означает, что контейнер для викторины заполнит 100% свободного места, куда вы его вставляете, а пользовательский параметр позволяет задать максимальную ширину контейнера.','Choose how you want your quiz to be rendered for users.'=>'Выберите, как вы хотите, чтобы ваш тест отображался для пользователей.','Choose how do you want to show quiz results to the participants.'=>'Выберите, как вы хотите показывать результаты викторины участникам.','Display Method'=>'Способ отображения','Evaluation Loader'=>'Оценочный загрузчик','Choose whether you want to show a loader while evaluating the selected answer in real-time. We recommend using this on long quizzes since evaluating an answer might take a bit longer.'=>'Выберите, хотите ли вы показывать загрузчик при оценке выбранного ответа в режиме реального времени. Мы рекомендуем использовать это при проведении длинных тестов, так как оценка ответа может занять немного больше времени.','Site Title'=>'Название сайта','Full Width'=>'Во всю ширину','Network\'s Main Site Role'=>'Роль основного сайта сети','Default Meta Keys'=>'Мета-ключи по умолчанию','If you don\'t want to create a user in the network\'s main site, set this meta key to {{strong}}Don\'t create a user in the network\'s main site{{/strong}}.'=>'Если Вы не хотите создавать пользователя на основном сайте сети, установите этот мета-ключ в {{strong}}Не создавайте пользователя на основном сайте сети{{{/strong}}.','Automatically log in newly activated users'=>'Автоматический вход в систему новых активированных пользователей','This will automatically log in a user upon successful activation of their account.'=>'Это автоматически приведет к входу пользователя в систему после успешной активации его учетной записи.','User Meta Mapping'=>'Пользовательское мета-сопоставление','Assign your form fields to the user meta keys to use the data collected from the visitor to create a user profile.'=>'Назначьте поля формы пользовательским метаключам, чтобы использовать данные, полученные от посетителя, для создания профиля пользователя.','Confirmation Page'=>'Страница подтверждения','Since the {{strong}}Password{{/strong}} user meta key is mapped to {{strong}}Auto Generate Password{{/strong}}, it\'s recommended to keep this option to {{strong}}Default{{/strong}} so the auto-generated password can be sent to the users.'=>'Так как мета-ключ пользователя {{strong}} Пароль {{/strong}} сопоставлен с {{strong}} Автогенерировать пароль {{/strong}}, рекомендуется оставить для этого параметра значение {{strong}} По умолчанию {{/strong}}, чтобы автоматически сгенерированный пароль можно было отправлять пользователям.','Manual Approval'=>'Ручное утверждение','Activation Email'=>'Электронная почта для активации','By default, the user account is activated upon form submission. However, you can choose between {{strong}}Email Activation{{/strong}}, which requires the user to click on an activation email, or {{strong}}Manual Approval{{/strong}} which requires site admin to approve an account.'=>'По умолчанию учетная запись пользователя активируется при отправке формы. Однако вы можете выбрать между {{strong}}Email Activation{{{/strong}}, которая требует от пользователя нажатия на активационное письмо, или {{strong}}Manual Approval{{{/strong}}, которая требует от администратора сайта одобрения учетной записи.','Since the activation requires manual approval from site admin, it\'s recommended to keep this option to {{strong}}Default{{/strong}} to let users know when their account is activated.'=>'Так как активация требует ручного одобрения от администратора сайта, рекомендуется оставить эту опцию в {{strong}}Default{{{/strong}}, чтобы пользователи знали, когда их учетная запись активирована.','Email Activation'=>'Активация по электронной почте','Choose the page to redirect users to when they click on the confirmation link.'=>'Выберите страницу, на которую будут перенаправляться пользователи при нажатии на ссылку подтверждения.','A site admin will have to manually approve each entry from the submissions page to activate the user accounts.'=>'Администратору сайта придется вручную утверждать каждую запись со страницы отправки, чтобы активировать учетные записи пользователей.','By default, WordPress sends an activation email containing user account information after the account activation. However, you can choose not to send this email.'=>'По умолчанию WordPress отправляет электронное письмо для активации, содержащее информацию об учетной записи пользователя, после активации учетной записи. Однако вы можете отказаться от отправки этого письма.','These settings will add some extra control on your registration process.'=>'Эти настройки добавят дополнительный контроль над процессом вашей регистрации.','Choose the activation method and other settings for the user accounts.'=>'Выберите способ активации и другие настройки для учетных записей пользователей.','Please select an email address for payment receipt.'=>'Пожалуйста, выберите адрес электронной почты для получения оплаты.','Email subject can\'t be empty'=>'Тема письма не может быть пустой','Hide the form if a user is already logged in'=>'Скрыть форму, если пользователь уже вошел в систему','These settings will add some extra control on your login process.'=>'Эти настройки добавят дополнительный контроль над процессом входа в систему.','Activation Method'=>'Способ активации','B'=>'B','Remember me'=>'Запомнить меня','Choose whether to show the {{strong}}Remember Me{{/strong}} field in your form. This option will add a Remember Me checkbox before the submit button.'=>'Выберите, показывать ли поле {{strong}}Remember Me{{/strong}} в вашей анкете. Эта опция добавит флажок Запомнить меня перед кнопкой отправки.','MB'=>'МБ','KB'=>'КБ','Login User'=>'Войти в систему Пользователя','Enabling this will hide the form from logged-in users.'=>'Включение этого параметра скроет форму от вошедших в систему пользователей.','Message (optional)'=>'Сообщение (необязательно)','Type a message for logged in users here...'=>'Введите здесь сообщение для зарегистрированных пользователей...','You can optionally add a message for logged in users, which appears when the form is hidden.'=>'При желании вы можете добавить сообщение для вошедших в систему пользователей, которое появляется, когда форма скрыта.','Login Fields'=>'Поля для входа в систему','Map your form fields to the meta keys and have additional control over the login form fields.'=>'Сопоставьте поля вашей формы с мета-ключами и получите дополнительный контроль над полями формы входа.','Form Fields Mapping'=>'Отображение полей формы','Assign your form fields to the meta keys required to login a user.'=>'Назначьте поля формы мета-ключам, необходимым для входа пользователя в систему.','Cookie Expiration'=>'Истечение срока действия файлов cookie','Users will have to provide login details again after the selected period.'=>'Пользователи должны будут снова предоставить данные для входа в систему по истечении выбранного периода.','Please fix the error(s) in the EMAIL tab.'=>'Пожалуйста, исправьте ошибки на вкладке "Электронная ПОЧТА".','Email body can\'t be empty'=>'Текст письма не может быть пустым','User Account Activation'=>'Активация учетной записи пользователя','Additional Settings'=>'Расширенные настройки','Remember Me Field'=>'Запомнить мои поля','Default height'=>'Высота по умолчанию','Choose the default minimum height of your textarea field.'=>'Выберите минимальную высоту поля текстовой области по умолчанию.','Rich-Text editor'=>'Форматированный текстовый редактор','Short'=>'Короткий','Confirm password'=>'Подтвердите пароль','Minimum password strength'=>'Минимальная надежность пароля','Choose a minimum password strength required to force your users to sign up with a password stronger than the minimum requirement.'=>'Выберите минимальный уровень надежности пароля, необходимый для того, чтобы заставить ваших пользователей регистрироваться с использованием пароля, более надежного, чем минимальное требование.','Bad'=>'Плохо','Good'=>'Хорошо','Strong'=>'Сильный','This is displayed when the user\'s password is weaker than the minimum requirement.'=>'Это отображается, когда пароль пользователя слабее минимального требования.','User Registration'=>'Регистрация пользователя','Provide the absolute URL of the page you want to redirect users to after submitting the login form. For example, to redirect users to the WordPress admin, use the URL  {{strong}}http://www.website.com/wp-admin/{{/strong}}.'=>'Укажите абсолютный URL на которую вы хотите перенаправить пользователей после отправки формы входа. Например, чтобы перенаправить пользователей к администратору WordPress, используйте URL {{strong}}http://www.website.com/wp-admin/{{/strong}}.','Email on element not found or not filled on submitted data.'=>'Электронная почта по элементу не найдена или не заполнена по представленным данным.','This message was sent from {site_url}'=>'Это сообщение было отправлено с {site_url}','Client ID is optional, unless you are on %1$sAgency-Mode%2$s, then you can find your desired Client ID on the %3$sAccount Settings%4$s > %5$sAPI Keys%6$s'=>'Идентификатор клиента является необязательным, если только вы не находитесь в %1$sAgency-Mode%2$s, то вы можете найти желаемый идентификатор клиента в %3$sAccount Settings%4$s > %5$sAPI Keys%6$s','New User Registration on {site_url}'=>'Регистрация нового пользователя на {site_url}','New User Registration on {site_url} needs approval.'=>'Регистрация нового пользователя на {site_url} требует одобрения.','Then click the %1$sAdd%2$s button.'=>'Затем нажмите кнопку %1$sAdd%2$s.','Then click the %1$sSave URLs%2$s button.'=>'Затем нажмите кнопку %1$sSave URLs%2$s.','Your new account on {site_title} is under review.'=>'Ваш новый аккаунт на {site_title} находится на рассмотрении.','Activate your account on {site_url}'=>'Активируйте свою учётную запись на {site_url}','Your new account on {site_title}'=>'Ваша новая учётная запись на {site_title}','Login to your Campaign Monitor account %1$shere%2$s.'=>'Войдите в свою учетную запись Campaign Monitor %1$shere%2$s.','Click %1$sAdd a new Redirect URL%2$s.'=>'Нажмите %1$sAdd новый URL перенаправления%2$s.','Thank you for signing up on our website. You are one step away from activating your account. '=>'Благодарим Вас за регистрацию на нашем сайте. Вы находитесь в одном шаге от активации своей учетной записи. ','You\'ll receive another email once the site admin approves your account. You should be able to login into your account after that.'=>'Вы получите еще одно электронное письмо, как только администратор сайта одобрит вашу учетную запись. После этого вы должны быть в состоянии войти в свою учетную запись.','User Confirmation Email'=>'Электронное письмо с подтверждением пользователя','Click on %1$sShow API Key%2$s, select and copy on the shown up value.'=>'Click on %1$sShow API Key%2$s, select and copy on the shown up value.','Go %1$shere%2$s to create new Slack App.'=>'Перейдите %1$sздесь%2$s, чтобы создать новое приложение Slack.','Go to Account Settings, then navigate to %1$sAPI Keys%2$s section.'=>'Перейдите в Настройки учетной записи, затем перейдите в раздел %1$sAPI Keys%2$s.','Click {submission_url} to view the submission on your website\'s dashboard.'=>'Щёлкните по {submission_url}, чтобы просмотреть отправку на панели управления вашего веб-сайта.','We have sent you another email containing a confirmation link. Please click on that link to activate your account.'=>'Мы отправили вам еще одно письмо, содержащее ссылку для подтверждения. Нажмите на эту ссылку, чтобы активировать ваш аккаунт.','Next, go to the %1$sFeatures%2$s &gt; %3$sOAuth & Permissions%4$s &gt; %5$sRedirect URLs%6$s section.'=>'Далее перейдите к разделу %1$sFeatures%2$s &gt; %3$sOAuth & Permissions%4$s &gt; %5$sRedirect URLs%6$s.','Once the Project creation is completed go to the %1$sBasic Information%2$s. Then scroll through %3$sApp Credentials%4$s, to take a note of %5$sClient ID%6$s and %7$sClient Secret%8$s.'=>'После создания проекта перейдите к %1$sBasic Information%2$s. Затем прокрутите %3$sApp Credentials%4$s, чтобы обратить внимание на %5$sClient ID%6$s и %7$sClient Secret%8$s.','Could not create user'=>'Не удалось создать пользователя','Register'=>'Регистрация','Registration'=>'Регистрация','That username is already activated.'=>'Это имя пользователя уже активировано.','Enter username or email address'=>'Введите имя пользователя или адрес электронной почты','Account registration successful. Please check your email inbox to activate your new account.'=>'Регистрация учетной записи прошла успешно. Пожалуйста, проверьте свой почтовый ящик, чтобы активировать новую учетную запись.','Account registration successful. A website admin must approve your account before you can log in. You’ll receive an email when your account is activated.'=>'Регистрация учетной записи прошла успешно. Администратор веб-сайта должен одобрить вашу учетную запись, прежде чем вы сможете войти в систему. Вы получите электронное письмо, когда ваша учетная запись будет активирована.','Invalid activation key.'=>'Неверный ключ активации.','Invalid entry ID.'=>'Неверный идентификатор входа.','Error! Entry was not deleted.'=>'Ошибка! Запись не была удалена.','The user is already active.'=>'Пользователь уже активен.','Login'=>'Вход','Sorry, that email address is already used!'=>'Этот адрес email уже используется!','Username or Email Address'=>'Имя пользователя или email-адрес','Confirm new password'=>'Подтвердите новый пароль','Couldn&#8217;t register you&hellip; please contact us if you continue to have problems.'=>'Регистрация не удалась&hellip; Пожалуйста, сообщите нам, если это проблема повторится.','Password'=>'Пароль','Password: %s'=>'Пароль: %s','Remember Me'=>'Запомнить меня','This email address is already registered.'=>'Этот адрес электронной почты уже зарегистрирован.','This username is already registered.'=>'Это имя пользователя уже зарегистрировано.','Username: %s'=>'Имя пользователя: %s','That username is currently reserved but may be available in a couple of days'=>'Это имя пользователя в настоящее время зарезервировано, но может быть доступно через пару дней','The attached file is empty and can\'t be uploaded.'=>'Прикрепленный файл пуст и не может быть загружен.','The email address can not be empty.'=>'Адрес электронной почты не может быть пустым.','The username can not be empty.'=>'Имя пользователя не может быть пустым.','https://wordpress.org/'=>'https://ru.wordpress.org/','Enter your password'=>'Введите свой пароль','Your password doesn\'t meet the minimum strength requirement. We recommend using 8 or more characters with a mix of letters, numbers & symbols.'=>'Ваш пароль не соответствует минимальным требованиям к надежности. Мы рекомендуем использовать 8 или более символов с сочетанием букв, цифр и символов.','You must confirm your chosen password.'=>'Вы должны подтвердить выбранный вами пароль.','Your passwords don\'t match.'=>'Ваши пароли не совпадают.','Your password is required'=>'Требуется ввести ваш пароль','Whoops, the passcode you entered was incorrect or expired.'=>'Упс, введенный вами пароль был неверным или истек.','Authenticate to login'=>'Аутентификация для входа в систему','The passcode was incorrect.'=>'Пароль был введен неверно.','That email address has already been used. Please check your inbox for an activation email. It will become available in a couple of days if you do nothing.'=>'Этот адрес электронной почты уже использовался. Пожалуйста, проверьте свой почтовый ящик на наличие письма для активации. Он станет доступен через пару дней, если вы ничего не предпримете.','This email address is not valid.'=>'Этот адрес электронной почты недействителен.','This username is invalid because it uses illegal characters. Please enter a valid username.'=>'Это имя пользователя недопустимо, поскольку в нем используются недопустимые символы. Пожалуйста, введите действительное имя пользователя.','Calculating Result'=>'Вычисление результата','Confirm Password'=>'Подтвердить пароль','Powered by WordPress'=>'Сайт работает на WordPress','Select Year'=>'Выбрать год','All Forms'=>'Все формы','We couldn\'t find any compatible data to import.'=>'Мы не смогли найти никаких совместимых данных для импорта.','Retry Import'=>'Повторите попытку импорта','Select the form.'=>'Выберите форму.','We have encountered an error while importing your forms from Contact Form 7 and selected add-ons. Unable to solve this? Contact our %1$ssupport%2$s team for further help.'=>'Мы столкнулись с ошибкой при импорте ваших форм из Contact Form 7 и выбранных дополнений. Не можете решить эту проблему? Свяжитесь с нашей командой %1$ssupport%2$s для получения дальнейшей помощи.','1. Visit Forminator and preview your forms to make sure everything looks perfect and adjust your forms with the additional settings Forminator offers as per your needs.'=>'1. Посетите Forminator и просмотрите Ваши формы, чтобы убедиться, что все выглядит идеально, и отрегулируйте Ваши формы с помощью дополнительных настроек, которые предлагает Forminator в соответствии с Вашими потребностями.','3. Deactivate Contact Form 7 and the add-ons if you don’t wish to use them anymore.'=>'3. Деактивируйте Contact Form 7 и дополнения, если вы не хотите их больше использовать.','Begin Import'=>'Начать импорт','We couldn\'t find any supported add-ons.'=>'Мы не смогли найти никаких поддерживаемых дополнений.','2. Use the Gutenberg block or shortcode to embed your forms in the required places.'=>'2. Используйте блок Gutenberg или шорткод для встраивания форм в необходимые места.','Contact Form 7 Conditional Fields'=>'Контактная форма 7 Условных полей','Import your form fields conditions and apply them automatically on your imported forms.'=>'Импортируйте условия полей формы и автоматически применяйте их к импортированным формам.','Import redirection URL settings and apply them on your imported forms in Forminator. Note that Forminator doesn’t support passing form fields as query parameters into redirect URL, redirection delay, and running a script after form submission.'=>'Импортируйте настройки URL-адреса перенаправления и примените их к импортированным формам в Forminator. Обратите внимание, что Forminator не поддерживает передачу полей формы в качестве параметров запроса в URL перенаправления, задержку перенаправления и запуск скрипта после отправки формы.','Contact Form Submissions'=>'Отправка контактной формы','Import your form submissions and show them on the submissions page.'=>'Импортируйте отправленные вами формы и покажите их на странице отправки.','Contact Form 7 - reCAPTCHA v2'=>'Контактная форма 7 - reCAPTCHA v2','Import your reCaptcha v2 API keys and configure the reCaptcha v2 on your imported forms.'=>'Импортируйте ключи API reCAPTCHA v2 и настройте reCAPTCHA v2 в импортированных формах.','Advanced Contact form 7 DB'=>'Расширенная контактная форма 7 DB','Please keep this modal open while we import your Contact Form 7 forms and add-ons. It will only take a few seconds.'=>'Пожалуйста, держите этот режим открытым, пока мы импортируем ваши формы контактной формы 7 и дополнения. Это займет всего несколько секунд.','Your selected forms from Contact Form 7 and the add-ons imported successfully.'=>'Выбранные вами формы из контактной формы 7 и дополнения успешно импортированы.','Following are the next recommended steps:'=>'Ниже приведены следующие рекомендуемые шаги:','Deactivate contact form 7'=>'Деактивировать контактную форму 7','Flamingo'=>'Фламинго','Import your form submissions from Flamingo and show them on the submissions page.'=>'Импортируйте отправленные вами формы из Flamingo и покажите их на странице отправки.','Honeypot for Contact Form 7'=>'Горшочек с медом для контактной формы 7','Enable honeypot protection on the imported forms in Forminator.'=>'Включите защиту honeypot для импортированных форм в Forminator.','Contact Form 7 Database Addon – CFDB7'=>'Контактная форма 7 Дополнение к базе данных – CFDB7','Import your form submissions from CFDB7 add-on and show them on the submissions page.'=>'Импортируйте отправленные вами формы из дополнения CFDB7 и покажите их на странице отправки.','Contact Form 7 Redirection'=>'Перенаправление контактной формы 7','Choose the Contact Form 7 add-ons you wish to import form data and settings from. %1$sNote:%2$s The importer only supports the most widely used add-ons. For less common add-ons, you\'ll need to manually configure the equivalent functionality in those imported forms.'=>'Выберите дополнения контактной формы 7, из которых вы хотите импортировать данные и настройки формы. %1$sNote:%2$s Импортер поддерживает только наиболее широко используемые дополнения. Для менее распространенных дополнений вам потребуется вручную настроить эквивалентную функциональность в этих импортированных формах.','Add-ons'=>'Дополнения','%1$s4. Additional settings:%2$s Forminator doesn\'t support CF7’s additional form settings.'=>'%1$s4. Дополнительные настройки:%2$s Forminator не поддерживает дополнительные настройки формы CF7.','%1$s5. Custom field IDs:%2$s Forminator creates a unique ID for each field, and the conditional logic relies on them. However, you can provide a custom CSS class for each field.'=>'%1$s5. Пользовательское поле IDs:%2$s Forminator создает уникальный ID для каждого поля, и условная логика полагается на них. Однако для каждого поля можно задать свой CSS-класс.','Import your forms from Ninja Forms'=>'Импортируйте свои формы из Ninja Forms','Specific Forms'=>'Конкретные формы','Third-Party Plugins'=>'Сторонние плагины','We noticed that Contact Form 7 is active on your website. You can use our built-in Contact Form 7 importer to import your existing forms and the relevant plugin settings from Contact Form 7 to Forminator. The importer supports the most widely used add-ons as well.'=>'Мы заметили, что контактная форма 7 активна на вашем сайте. Вы можете использовать наш встроенный импортер контактной формы 7, чтобы импортировать существующие формы и соответствующие настройки плагина из контактной формы 7 в Forminator. Импортер также поддерживает наиболее широко используемые дополнения.','Import Contact Form 7 Forms'=>'Импорт Контактной формы 7 Форм','Unsupported form fields and settings'=>'Неподдерживаемые поля и настройки формы','Dismiss%1$s this notice%2$s'=>'Отклонить%1$s это уведомление%2$s','Use this tool to import your existing forms from other third-party form builder plugins automatically to Forminator.'=>'Используйте этот инструмент для автоматического импорта существующих форм из других сторонних плагинов form Builder в Forminator.','Import your existing forms and the relevant plugin settings from the Contact Form 7. The importer supports a few widely used add-ons as well.'=>'Импортируйте существующие формы и соответствующие настройки плагина из контактной формы 7. Импортер также поддерживает несколько широко используемых дополнений.','Contact Form 7 plugin is not active on your website.'=>'Плагин Contact Form 7 не активен на вашем сайте.','Ninja Forms'=>'Формы ниндзя','Import your forms from Gravity Forms'=>'Импортируйте свои формы из Gravity Forms','%1$s1. Quiz field:%2$s Forminator doesn\'t have a built-in quiz field, however, you can enable CAPTCHA and Honeypot protection on your imported forms.'=>'%1$s1. Поле для викторины:%2$s Forminator не имеет встроенного поля для викторины, однако вы можете включить защиту от CAPTCHA и Honeypot в импортированных формах.','%1$s3. reCAPTCHA v3 integration:%2$s At this stage, Forminator can\'t import your existing reCAPTCHA integration. You can set this up manually on your imported forms once they are transferred.'=>'%1$s3. Интеграция reCAPTCHA v3:%2$s На этом этапе Forminator не может импортировать существующую интеграцию reCAPTCHA. Вы можете настроить это вручную в импортированных формах после их переноса.','Choose the forms you\'d like to import from the Contact Form 7 plugin. Note that we will strip off any %1$sunsupported form fields and settings%2$s during the import.'=>'Выберите формы, которые вы хотите импортировать из плагина Contact Form 7. Обратите внимание, что во время импорта мы удалим все %1$sнеподдерживаемые поля формы и настройки%2$s.','%1$s2. ConstantContact:%2$s Forminator doesn\'t integrate directly with ConstantContact. However, you can use %3$sWebhook integration%4$s to send your leads to ConstantContact.'=>'%1$s2. ConstantContact:%2$ss Forminator не интегрируется напрямую с ConstantContact. Однако вы можете использовать %3$sWebhook integration%4$s для отправки ваших потенциальных клиентов в ConstantContact.','Contact Form 7'=>'Contact Form 7','Gravity Forms'=>'Gravity Forms','Can\'t find form to import'=>'Не удается найти форму для импорта','Could not import the forms. Check if the selected form plugin is active'=>'Не удалось импортировать формы. Проверьте, активен ли выбранный плагин формы','Import Ninja Forms'=>'Импорт форм Ниндзя','Import Gravity Forms'=>'Импорт Гравитационных форм','Forminator - Import your Contact Form 7 forms automatically'=>'Forminator - Автоматически импортируйте вашу контактную форму 7 форм','Active Modules'=>'Активные модули','No pipeline found on your HubSpot account. Please create one.'=>'В вашем аккаунте HubSpot конвейер не найден. Пожалуйста, создайте его.','%1$sCongratulations!%2$s You have started collecting live payments on this form - that\'s awesome. We have spent countless hours developing this free plugin for you, and we would really appreciate it if you could drop us a rating on wp.org to help us spread the word and boost our motivation.'=>'%1$sБлагодарности!%2$s Вы начали собирать реальные платежи в этой форме - это потрясающе. Мы потратили бесчисленное количество часов на разработку этого бесплатного плагина для вас, и мы были бы очень признательны, если бы вы могли оставить нам оценку на wp.org чтобы помочь нам распространить информацию и повысить нашу мотивацию.','Send email only if there are new submissions'=>'Отправляйте электронное письмо только в том случае, если есть новые материалы','Apply Submission Filters'=>'Применение фильтров отправки','Excellent! You\'ve been using Forminator for a while now. Hope you are enjoying it so far. We have spent countless hours developing this free plugin for you, and we would really appreciate it if you could drop us a rating on wp.org to help us spread the word and boost our motivation.'=>'Превосходно! Вы уже некоторое время пользуетесь Forminator. Надеюсь, вам это пока нравится. Мы потратили бесчисленное количество часов на разработку этого бесплатного плагина для вас, и мы были бы очень признательны, если бы вы могли оставить нам оценку на wp.org чтобы помочь нам распространить информацию и повысить нашу мотивацию.','Hey, we noticed you just crossed %1$s submissions%2$s on this %3$s - that\'s awesome! We have spent countless hours developing this free plugin for you, and we would really appreciate it if you could drop us a rating on wp.org to help us spread the word and boost our motivation.'=>'Эй, мы заметили, что вы только что перечеркнули %1$s submitions%2$s на этом %3$s - это потрясающе! Мы потратили бесчисленное количество часов на разработку этого бесплатного плагина для вас, и мы были бы очень признательны, если бы вы могли оставить нам оценку на wp.org чтобы помочь нам распространить информацию и повысить нашу мотивацию.','No Thanks'=>'Нет, спасибо','All Form Fields'=>'Все поля формы','All Non Empty Fields'=>'Все непустые поля','Query parameter (optional)'=>'Параметр запроса (необязательно)','Awesome! You\'ve published more than %d modules with Forminator. Hope you are enjoying it so far. We have spent countless hours developing this free plugin for you, and we would really appreciate it if you could drop us a rating on wp.org to help us spread the word and boost our motivation.'=>'Потрясающе! Вы опубликовали более модулей %d с помощью Forminator. Надеюсь, вам это пока нравится. Мы потратили бесчисленное количество часов на разработку этого бесплатного плагина для вас, и мы были бы очень признательны, если бы вы могли оставить нам оценку на wp.org чтобы помочь нам распространить информацию и повысить нашу мотивацию.','You can pre-populate this field dynamically using the query parameter passed in your form URL. Enter the query parameter key to fetch its value from your form URL below.'=>'Вы можете предварительно заполнить это поле динамически, используя параметр запроса, переданный в URL-адресе вашей формы. Введите ключ параметра запроса, чтобы получить его значение из приведенного ниже URL-адреса вашей формы.','Social Share Message'=>'Сообщение в социальной сети','Page/Post Title'=>'Заголовок страницы/ Сообщения','Page/Post URL'=>'URL страницы /Публикации','Site URL'=>'URL-адрес сайта','Rate Forminator'=>'Рейтинг Forminator','Maybe later'=>'Возможно позже','Enter value'=>'Введите значение','Send'=>'Отправить','Delete Notification'=>'Удалить уведомление','E.g. Sales Team Notification'=>'Например, уведомление отдела продаж','E.g. sales@website.com'=>'Например, sales@website.com','Email Routing'=>'Маршрутизация электронной почты','Email routing is enabled'=>'Маршрутизация электронной почты включена','Enter CC email here'=>'Введите адрес электронной почты CC здесь','No Previous button'=>'Нет предыдущей кнопки','Please add email routing'=>'Пожалуйста, добавьте маршрутизацию электронной почты','Please select rule'=>'Пожалуйста, выберите правило','Query parameter'=>'Параметр запроса','Send to {{strong}}"%(label)s"{{/strong}} if {{strong}}%(field)s{{/strong}} %(rule)s {{strong}}%(value)s{{/strong}}'=>'Отправить в {{strong}}"%(label)s"{{/strong}} если {{strong}}%(field)s{{{/strong}} %(rule)s {{{strong}}%(value)s{{/strong}}','Note: The query parameter\'s value passed in URL should match with the selected date format.'=>'Примечание: Значение параметра запроса, переданное в URL, должно совпадать с выбранным форматом даты.','m-d-Y'=>'м-д-У','d-m-Y'=>'д-м-У','Y/m/d'=>'Г/м/д','Y.m.d'=>'Y.М.д.','m.d.Y'=>'м.д.У','d.m.Y'=>'д.м.Н.','E.g. query_parameter_key'=>'Например. query_parameter_key','Note: Pass comma-separated values for this query parameter to pre-populate multiple options.'=>'Примечание: Передайте значения этого параметра запроса через запятую, чтобы предварительно заполнить несколько параметров.','Show files in media library'=>'Показывать файлы в медиатеке','Choose whether you want to show the files uploaded by your visitors using this field in your media library.'=>'Выберите, хотите ли вы показывать файлы, загруженные вашими посетителями, используя это поле в вашей медиатеке.','Don\'t Send'=>'Не отправляйте','Are you sure you wish to delete this Notification?'=>'Вы уверены, что хотите удалить это уведомление?','Please enter recipients'=>'Пожалуйста, введите получателей','Add Email Notification'=>'Добавить уведомление по электронной почте','E.g. New Form Submission'=>'Например. Подача новой формы','The default behavior is to send the email to the same recipients. If you want to send this email to different recipients conditionally, you can enable the email routing and change the recipients of this email based on the user input.'=>'По умолчанию электронное письмо отправляется тем же получателям. Если вы хотите отправить это электронное письмо разным получателям условно, вы можете включить маршрутизацию электронной почты и изменить получателей этого электронного письма на основе введенных пользователем данных.','Separate multiple emails with a comma'=>'Разделите несколько писем запятой','Enter from name here'=>'Введите здесь имя пользователя','Enter from email here'=>'Введите адрес электронной почты здесь','Enter reply-to email here'=>'Введите ответ на электронное письмо здесь','CC Emails'=>'Электронные письма CC','Enter BCC email here'=>'Введите адрес электронной почты BCC здесь','BCC Emails'=>'Электронные письма BCC','Choose whether to show a progress indicator on top of your form, so your users know how far they are through your form.'=>'Выберите, показывать ли индикатор выполнения поверх вашей формы, чтобы ваши пользователи знали, как далеко они продвинулись по вашей форме.','You can send customized email notifications to your site admins and visitors on successful form submission. Advanced features like email routing and conditional emails provide granular control over the email notifications.'=>'Вы можете отправлять индивидуальные уведомления по электронной почте администраторам и посетителям вашего сайта об успешной отправке формы. Расширенные функции, такие как маршрутизация электронной почты и условные электронные письма, обеспечивают детальный контроль над уведомлениями по электронной почте.','this email if'=>'это электронное письмо, если','By default, this email is always sent on form submission. You can add conditions to send this email conditionally based on user input.'=>'По умолчанию это электронное письмо всегда отправляется при отправке формы. Вы можете добавить условия для отправки этого электронного письма условно на основе пользовательских данных.','Routing Condition'=>'Условие маршрутизации','You haven\'t defined any email routing rules yet. Click on the "+ Add Rule" button to add the recipients along with the routing rules.'=>'Вы еще не определили никаких правил маршрутизации электронной почты. Нажмите на кнопку "+ Добавить правило", чтобы добавить получателей вместе с правилами маршрутизации.','more recipient(s)'=>'больше получателей(ов)','No Next button'=>'Нет следующей кнопки','Pre-populate'=>'Предварительно заполнить','Empty labels are not allowed for meta values!'=>'Пустые этикетки не допускаются для мета-значений!','The label is to help you identify this email and won\'t appear anywhere in the email.'=>'Этикетка предназначена для того, чтобы помочь вам идентифицировать это электронное письмо, и она нигде не появится в письме.','Your form is divided into multiple pages by Page Break field(s), and you can customize the label of each page here. Page names appear on your form header along with the progress indicator.'=>'Ваша форма разделена на несколько страниц с помощью полей (полей) разрыва страницы, и вы можете настроить этикетку каждой страницы здесь. Названия страниц отображаются в заголовке формы вместе с индикатором выполнения.','From Email'=>'Из Email','Note: The query parameter\'s value passed in URL should match with the {{link}}alpha-2 country code{{/link}} of the country you want to pre-populate dynamically.'=>'Замечание: Значение параметра запроса, передаваемое в URL, должно совпадать с кодом страны {{{link}}alpha-2{{/link}} страны, которую вы хотите динамически препарировать.','Since you are using Page Break field(s) to divide your form into multiple pages, use the pagination settings to customize the page label, progress indicator, and the buttons on each page.'=>'Поскольку вы используете поля разрыва страницы для разделения формы на несколько страниц, используйте параметры разбивки на страницы, чтобы настроить этикетку страницы, индикатор выполнения и кнопки на каждой странице.','Field Mapping'=>'Отображение полей','Page '=>'Страница ','Page Break'=>'Разрыв страницы','Select a list'=>'Выберите список','Ticket Name'=>'Название билета','Ticket Status'=>'Статус билета','I got {quiz_result} on {quiz_name} quiz!'=>'У меня есть {quiz_result} на {quiz_name} викторину!','Static list only'=>'Только статический список','Ticket Description (optional)'=>'Описание билета (необязательно)','Query Parameter'=>'Параметр запроса','Pipeline can not be empty.'=>'Конвейер не может быть пустым.','HubSpot List (optional)'=>'Список точек доступа (необязательно)','No static lists found on your HubSpot account'=>'В вашем аккаунте HubSpot не найдено статических списков','You can optionally add the contact to a static HubSpot list. Leave it empty to create a contact without adding it to a list.'=>'При желании вы можете добавить контакт в статический список HubSpot. Оставьте его пустым, чтобы создать контакт, не добавляя его в список.','Create Ticket'=>'Создать тикет','In addition to adding a new contact to your HubSpot account, you can also create a HubSpot ticket for each form submission.'=>'Помимо добавления нового контакта в свою учетную запись HubSpot, вы также можете создавать тикет HubSpot для каждой отправки формы.','Create a HubSpot ticket for each submission'=>'Создайте тикет HubSpot для каждой отправки','Authorize Forminator to access HubSpot tickets'=>'Авторизуйте Forminator для доступа к билетам HubSpot','Forminator requires additional permissions to create HubSpot tickets. Note that you will be taken to HubSpot website to grant Forminator access to HubSpot tickets and redirected back here.'=>'Forminator требует дополнительных разрешений для создания билетов на HubSpot. Обратите внимание, что вы попадете на сайт HubSpot, чтобы предоставить Forminator доступ к билетам HubSpot, и будете перенаправлены обратно сюда.','Pipeline'=>'Трубопровод','Use the "+" icon to add form fields'=>'Используйте значок "+" для добавления полей формы','Supported File (optional)'=>'Поддерживаемый файл (необязательно)','Select a file upload field'=>'Выберите поле для загрузки файла','Previous'=>'Назад','Stripe Payment ID does not exist.'=>'Идентификатор платежа Stripe не существует.','Empty'=>'Пусто','Recommendations'=>'Рекомендации','Base class'=>'Базовый класс','Customer email address (optional)'=>'Адрес электронной почты клиента (необязательно)','Customer name (optional)'=>'Имя клиента (необязательно)','Select a name field'=>'Выберите поле имени','Your Payment ID is empty!'=>'Ваш идентификатор платежа пуст!','Selected Forms'=>'Выбранные формы','Billing address (optional)'=>'Платежный адрес (необязательно)','Select an address field'=>'Выберите поле адреса','Note: Stripe field automatically validates the card as the user fills the card details regardless of the validation behavior set on the Behaviours tab.'=>'Примечание: Поле Stripe автоматически проверяет карту, когда пользователь заполняет данные карты, независимо от режима проверки, установленного на вкладке "Поведение".','If you are collecting billing details on your forms, you can send that data to Stripe. The billing details will appear on your Stripe dashboard for each payment.'=>'Если вы собираете платежные данные в своих формах, вы можете отправить эти данные в Stripe. Платежные данные будут отображаться на панели управления Stripe для каждого платежа.','Focused'=>'Сосредоточенный','Autofilled (Chrome and Safari only)'=>'Автозаполнение (только для Chrome и Safari)','Please enter PayPal payment amount!'=>'Пожалуйста, введите сумму платежа PayPal!','Please select PayPal payment variable field!'=>'Пожалуйста, выберите поле переменной оплаты PayPal!','Your All-in-One WordPress Platform'=>'Ваша универсальная платформа WordPress','Error: Module object is corrupted!'=>'Ошибка: Объект модуля поврежден!','Error: Your module ID doesn\'t exist!'=>'Ошибка: Ваш идентификатор модуля не существует!','Payment amount should be larger than 0.'=>'Сумма платежа должна быть больше 0.','Error: Stripe field doesn\'t exist in your form!'=>'Ошибка: поле Stripe не существует в вашей форме!','Meta Data'=>'Мета данные','Billing Details'=>'Платёжные реквизиты','Stripe automatically adds classes to the container DOM element based on the field state. However, you can customize them here. {{link}}Read more{{/link}}'=>'Строка автоматически добавляет классы к контейнерному элементу DOM на основе состояния поля. Однако вы можете настроить их здесь. {{link}}Читать далее{{/link}}.','To make Forminator\'s Stripe field %1$sSCA Compliant%2$s, we have replaced the Stripe Checkout modal with Stripe Elements which adds an inline field to collect your customer\'s credit or debit card details. Your existing forms with Stripe field are automatically updated, but we recommend checking them to ensure everything works fine.'=>'Чтобы сделать поле Stripe Forminator %1$sSCA-совместимым%2$s, мы заменили модальное окно Stripe Checkout на Stripe Elements, которое добавляет встроенное поле для сбора данных кредитной или дебетовой карты вашего клиента. Ваши существующие формы с полем Stripe автоматически обновляются, но мы рекомендуем проверить их, чтобы убедиться, что все работает нормально.','Complete'=>'Выполнено','Invalid'=>'Недействительный','Auto'=>'Авто','Payment Receipt'=>'Квитанция об оплате','Payment description'=>'Описание платежа','Postal code'=>'Почтовый индекс','E.g. Company Name'=>'Например, название компании','Up to 22 characters only'=>'Только до 22 символов','Choose your preferred language for the Stripe field. This will affect the placeholders language, and the card validation errors returned by the Stripe.'=>'Выберите предпочитаемый язык для поля Stripe. Это повлияет на язык заполнителей и ошибки проверки карты, возвращаемые Stripe.','Card icon'=>'Значок карты','Choose whether you want to show the card icon on the Stripe field.'=>'Выберите, хотите ли вы отображать значок карты в поле Полосы.','Choose whether you want to collect the postal code on the Stripe field.'=>'Выберите, хотите ли вы получить почтовый индекс в поле Stripe.','Prefill (optional)'=>'Предварительная заливка (необязательно)','If you are already collecting ZIP code on your form, you can pre-fill it on the Stripe field.'=>'Если вы уже указываете почтовый индекс в своей форме, вы можете предварительно заполнить его в поле Stripe.','Payment Details (optional)'=>'Платежные реквизиты (необязательно)','You can add a statement decipher and a description to help you and your customers recognise the transactions made on this form.'=>'Вы можете добавить расшифровку выписки и описание, чтобы помочь вам и вашим клиентам распознавать транзакции, совершенные в этой форме.','Statement decipher'=>'Расшифровка заявления','This is the business name your customers will see on their card statement.'=>'Это название компании, которое ваши клиенты будут видеть в выписке по своей карте.','This appears on your Stripe account and on the payment receipt sent to your customers.'=>'Это отображается в вашем аккаунте Stripe и в квитанции об оплате, отправленной вашим клиентам.','Card Validation'=>'Проверка подлинности карты','Choose whether you want Stripe to email a receipt to your customers on successful payment. Note that Stripe sends the email receipt only for live payments. {{link}}Customize email template{{/link}}.'=>'Выберите, хотите ли вы, чтобы Stripe отправлял вашим клиентам квитанцию об успешной оплате по электронной почте. Обратите внимание, что Stripe отправляет квитанцию по электронной почте только для живых платежей. {{link}}Настроить шаблон электронной почты{{/link}}.','Credit / Debit Card'=>'Кредитная / дебетовая карта','Are you sure you wish to delete the submissions on this poll?'=>'Вы уверены, что хотите удалить материалы, представленные в этом опросе?','Are you sure you want to disconnect your Stripe Account? This will affect the forms using the Stripe field.'=>'Вы уверены, что хотите отключить свою учетную запись Stripe? Это повлияет на формы, использующие поле Stripe.','0.1'=>'0.1','0.2'=>'0.2','0.3'=>'0.3','0.4'=>'0.4','0.5'=>'0.5','0.6'=>'0.6','0.7'=>'0.7','0.8'=>'0.8','0.9'=>'0.9','1.0'=>'1.0','Basics'=>'Основы','General settings'=>'Общие настройки','Size'=>'Размер','Tooltips'=>'Всплывающие подсказки','Choose the reCAPTCHA type you want to use on your form. You can read more about the different reCAPTCHA types {{link}}here{{/link}} and then choose the one which suits you the best.'=>'Выберите тип reCAPTCHA, который вы хотите использовать в вашей форме. Вы можете прочитать больше о различных типах reCAPTCHA {{link}}}где-нибудь{{/link}}, а затем выбрать тот, который подходит вам лучше всего.','Create Contact'=>'Создать контакт','Custom Answer Input'=>'Пользовательский ввод ответа','HubSpot Fields'=>'Поля HubSpot','Please enter valid number.'=>'Пожалуйста, введите действительный номер.','Successful response message will be displayed after poll submission succeeds.'=>'Сообщение об успешном ответе будет отображено после успешной отправки опроса.','We recommend using sandbox mode to ensure the payments are working as expected and when you are ready to start 