нные. Пожалуйста, проверьте свою форму и повторите попытку','HubSpot Integration'=>'Интеграция с HubSpot','HubSpot Info'=>'Информация о HubSpot','Deactivate this HubSpot Integration from this Form.'=>'Отключите эту интеграцию с HubSpot из этой формы.','No status found on your HubSpot account. Please create one.'=>'Статус не найден в вашем аккаунте HubSpot. Пожалуйста, создайте его.','HubSpot is not connected'=>'HubSpot не подключен','Invalid Form Settings of HubSpot'=>'Неверные настройки формы HubSpot','No active HubSpot connection found in this form'=>'В этой форме не найдено активного подключения к HubSpot','You are already connected to the HubSpot. You can disconnect your HubSpot Integration (if you need to) using the button below.'=>'Вы уже подключены к HubSpot. Вы можете отключить интеграцию с HubSpot (если вам нужно), используя кнопку ниже.','Authenticate your HubSpot account using the button below. Note that you\'ll be taken to the HubSpot website to grant access to Forminator and then redirected back.'=>'Аутентифицируйте свою учетную запись HubSpot, используя кнопку ниже. Обратите внимание, что вы перейдете на веб-сайт HubSpot, чтобы предоставить доступ к Forminator, а затем будете перенаправлены обратно.','Awesome! You are connected to HubSpot. You can now go to your forms and activate HubSpot integration to collect data.'=>'Потрясающе! Вы подключены к HubSpot. Теперь вы можете перейти к своим формам и активировать интеграцию с HubSpot для сбора данных.','Authenticating'=>'Аутентификация','%1$s Connected'=>'Подключено %1$s','Job Title'=>'Название должности','You are connected to %1$s%2$s%3$s.'=>'Вы подключены к %1$s%2$s%3$s.','Blank'=>'Пустой','Deactivate'=>'Деактивировать','Mar'=>'Мар','North Macedonia'=>'Северная Македония','Services'=>'Услуги','Close this dialog window.'=>'Закройте это диалоговое окно.','PayPal amount must be greater than 0.'=>'Сумма PayPal должна быть больше 0.','has been disconnected successfully.'=>'был успешно отключен.','is connected successfully.'=>'успешно подключен.','is activated successfully.'=>'успешно активируется.','Deactivate Mailchimp from this Form.'=>'Деактивируйте Mailchimp из этой формы.','Deactivate Webhook from this Form.'=>'Деактивируйте Webhook из этой формы.','Deactivate Webhook from this Poll.'=>'Отключите Webhook от этого опроса.','Deactivate Webhook from this Quiz.'=>'Отключите Webhook от этого теста.','Forminator Shortcodes'=>'Короткие коды Forminator','Select an option from the dropdown menu and generate a shortcode to insert in your post or page.'=>'Выберите нужный вариант из выпадающего меню и сгенерируйте шорткод для вставки в свой пост или страницу.','Please, select an option before you proceed.'=>'Пожалуйста, выберите вариант, прежде чем продолжить.','Select Custom Form'=>'Выберите Пользовательскую форму','Failed to configure PayPal payment'=>'Не удалось настроить платеж PayPal','Some error has occurred while connecting to your PayPal account. Please resolve the following errors and try to connect again.'=>'Произошла какая-то ошибка при подключении к вашей учетной записи PayPal. Пожалуйста, устраните следующие ошибки и попробуйте подключиться снова.','Subscribe'=>'Подписка','Quote Request'=>'Запрос котировки','Additional notes'=>'Дополнительные примечания','Request Quote'=>'Запрос котировки','Jan'=>'Янв.','Feb'=>'Февраль','Apr'=>'Апрель','Jun'=>'Июнь','Jul'=>'Июль','Aug'=>'Август','Sep'=>'Сентябрь','Oct'=>'Октябрь','Nov'=>'Ноябрь','Dec'=>'Декабрь','Stripe Payment'=>'Оплата через систему Stripe','Choose an option'=>'Выбрать опцию','Generate Shortcode'=>'Генерация шорткода','Submitting...'=>'Отправка...','Choose a template'=>'Выберите шаблон','Select month'=>'Выберите месяц','View Docs'=>'Просмотр документов','Activate App'=>'Активировать приложение','Active Apps'=>'Активные приложения','Available Apps'=>'Доступные приложения','Client Id'=>'Идентификатор клиента','Select an email field'=>'Выберите поле электронной почты','Select rule'=>'Выберите правило','Use PayPal Checkout to process payments in your forms.'=>'Используйте PayPal Checkout для обработки платежей в ваших формах.','You can send this form\'s data to any of the connected third party apps. Connect to more apps on the {{link}}Integrations{{/link}} page.'=>'Вы можете отправить данные этой формы в любое из подключенных сторонних приложений. Подключайтесь к большему количеству приложений на странице {{link}}Интеграции{{/link}}.','Condition (required)'=>'Условие (обязательное)','Stripe account disconnected successfully.'=>'Учетная запись Stripe успешно отключена.','PayPal account disconnected successfully.'=>'Учетная запись PayPal успешно отключена.','PayPal account connected successfully. You can now add the PayPal field to your forms and start collecting payments.'=>'Учетная запись PayPal успешно подключена. Теперь вы можете добавить поле PayPal в свои формы и начать собирать платежи.','Please input sandbox client id'=>'Пожалуйста, введите идентификатор клиента песочницы','Please input sandbox secret key'=>'Пожалуйста, введите секретный ключ песочницы','Please input live client id'=>'Пожалуйста, введите идентификатор реального клиента','You\'ve entered an invalid sandbox secret key'=>'Вы ввели недопустимый секретный ключ песочницы','You\'ve entered an invalid sandbox client id'=>'Вы ввели неверный идентификатор клиента изолированной среды','You\'ve entered an invalid live client id'=>'Вы ввели неверный идентификатор реального клиента','Customize one of our pre-made form templates, or start from scratch.'=>'Настройте один из наших готовых шаблонов форм или начните с нуля.','Day is'=>'День - это','Day is not'=>'День - это не','Month is'=>'Месяц - это','Month is not'=>'Месяц - это не','You can have only one PayPal field in your form for PayPal to work accurately. Please delete the existing PayPal field to add a new one.'=>'У вас может быть только одно поле PayPal в вашей форме, чтобы PayPal работал точно. Пожалуйста, удалите существующее поле PayPal, чтобы добавить новое.','You can have only one payment field in your form. Please delete the existing payment field to add another one.'=>'В вашей форме может быть только одно поле для оплаты. Пожалуйста, удалите существующее поле оплаты, чтобы добавить другое.','Please connect your PayPal account first!'=>'Пожалуйста, сначала подключите свой аккаунт PayPal!','Payment Data'=>'Платежные данные','day is'=>'день - это','day is not'=>'день - это не','month is not'=>'месяц - это не','month is'=>'месяц - это','Connect App'=>'Подключить приложение','Configure App'=>'Настройка приложения','Forminator integrates with your favorite third party apps. You can connect to the available apps via their API here and activate them to collect data in the Integrations tab of your forms, polls or quizzes.'=>'Forminator интегрируется с вашими любимыми сторонними приложениями. Вы можете подключиться к доступным приложениям через их API здесь и активировать их для сбора данных на вкладке интеграции ваших форм, опросов или опросов.','You are not sending this module\'s data to any third party apps. You can activate any of the connected apps below and start sending this module\'s data to them.'=>'Вы не отправляете данные этого модуля в какие-либо сторонние приложения. Вы можете активировать любое из подключенных приложений ниже и начать отправлять им данные этого модуля.','These apps are collecting data of your module.'=>'Эти приложения собирают данные вашего модуля.','Connected Apps'=>'Подключенные приложения','You are connected to these apps via their API. Connect to more apps on the %1$sIntegrations%2$s page.'=>'Вы подключены к этим приложениям через их API. Подключайтесь к другим приложениям на странице %1$sIntegrations%2$s.','To activate any of these to collect data, go to the Integrations tab of your forms, polls or quizzes.'=>'Чтобы активировать любой из них для сбора данных, перейдите на вкладку Интеграции ваших форм, опросов или опросов.','You are not connected to any third party apps. You can connect to the available apps listed below and activate them in your modules to collect data.'=>'Вы не подключены ни к каким сторонним приложениям. Вы можете подключиться к доступным приложениям, перечисленным ниже, и активировать их в своих модулях для сбора данных.','Sandbox Client ID'=>'Идентификатор клиента песочницы','Enter your sandbox client id'=>'Введите свой идентификатор клиента песочницы','Sandbox Secret'=>'Секрет Песочницы','Enter your sandbox secret'=>'Введите свой секрет песочницы','Live Client ID'=>'Живой идентификатор Клиента','Enter your live client id'=>'Введите свой реальный идентификатор клиента','Enter your live secret id'=>'Введите свой секретный идентификатор live secret id','Connect your PayPal business account with Forminator to use PayPal field for collecting payments in your forms.'=>'Подключите свой бизнес-аккаунт PayPal к Forminator, чтобы использовать поле PayPal для сбора платежей в ваших формах.','Connect PayPal Account'=>'Подключить учетную запись PayPal','Connect To PayPal'=>'Подключение к PayPal','Disconnect PayPal Account'=>'Отключить учетную запись PayPal','Choose the default charge currency for your PayPal payments. You can override this while setting up the PayPal field in your forms.'=>'Выберите валюту оплаты по умолчанию для ваших платежей PayPal. Вы можете переопределить это при настройке поля PayPal в своих формах.','Connect to more third party apps on the %1$sIntegrations%2$s page and activate them to collect the data of this module here.'=>'Подключитесь к другим сторонним приложениям на странице %1$s Integrations%2$s и активируйте их для сбора данных этого модуля здесь.','Enter your PayPal REST API keys to connect your account. You can create a REST API app %1$shere%2$s to grab the credentials.'=>'Введите ключи PayPal REST API для подключения вашего счета. Вы можете создать приложение REST API %1$shere%2$s для получения учетных данных.','To be able to use PayPal Payments feature please upgrade your PHP to %1$sversion %2$s%3$s or above.'=>'Для использования функции PayPal Payments, пожалуйста, обновите ваш PHP до версии %1$sversion %2$s%3$s или выше.','You are not connected to any third party apps. You can connect to the available apps via their API on the %1$sIntegrations%2$s page and come back to activate them for collecting data of this module.'=>'Вы не подключены к сторонним приложениям. Вы можете подключиться к доступным приложениям через их API на странице %1$sIntegrations%2$s и вернуться, чтобы активировать их для сбора данных этого опроса.','Account Type'=>'Тип аккаунта','Customize'=>'Настроить','Blue'=>'Синий','Debug Mode'=>'Режим отладки','E.g. 250'=>'Например, 250','Height'=>'Высота','Rectangular'=>'Прямоугольный','Sandbox'=>'Песочница','Shape'=>'Форма','White'=>'Белый','px'=>'px','By default, PayPal detects the language for the visitors based on their geolocation and browser preferences. It is recommended to pass this parameter only if you need the PayPal buttons to render in the same language as the rest of your site. {{link}}Supported locale codes.{{/link}}'=>'По умолчанию PayPal определяет язык для посетителей на основе их геолокации и предпочтений браузера. Рекомендуется передавать этот параметр только в том случае, если вам нужны кнопки PayPal для рендеринга на том же языке, что и остальной сайт. {{link}} Поддерживаемые коды локали.{{/link}}','Choose whether to show the default PayPal tagline {{strong}}"The safer, easier way to pay"{{/strong}} below your PayPal button.'=>'Выберите, следует ли показывать под кнопкой PayPal теглайн по умолчанию {{strong}} "Более безопасный и простой способ оплаты"{{/strong}}.','We recommend the vertical layout as it allows additional payment methods such as Credit Cards. You can read about the layout options {{link}}here{{/link}}.'=>'Мы рекомендуем вертикальную планировку, поскольку она позволяет использовать дополнительные способы оплаты, такие как Кредитные карты. Вы можете прочитать о вариантах макета {{ссылка}} где-нибудь здесь{{/ссылка}.','Submission Indicator'=>'Индикатор представления','Choose whether you want to show a loader on your form until it is submitted. We highly recommend using this on long forms or forms with payment field since they may take a few seconds to submit.'=>'Выберите, хотите ли вы показывать загрузчик в своей форме до тех пор, пока он не будет отправлен. Мы настоятельно рекомендуем использовать это для длинных форм или форм с полем оплаты, поскольку их отправка может занять несколько секунд.','Show Loader'=>'Показать Загрузчик','E.g. Submitting...'=>'Например, Подчинение...','Choose the text to show on the right of loading icon'=>'Выберите текст, который будет отображаться справа от значка загрузки','PayPal Checkout'=>'Оформить заказ через PayPal','Pay with PayPal'=>'Оплата с помощью PayPal','PayPal field replaces the submit button of your form with the PayPal Smart Payment Buttons. The PayPal buttons will automatically submit the form after a successful payment.'=>'Поле PayPal заменяет кнопку отправки вашей формы кнопками смарт-платежей PayPal. Кнопки PayPal автоматически отправят форму после успешной оплаты.','By default, we stack the options vertically. However, you can change the options layout below.'=>'По умолчанию мы складываем параметры вертикально. Однако вы можете изменить расположение параметров ниже.','It\'s recommended to charge in your customers\' currency to drive more sales and avoid foreign exchange fee to your customers.'=>'Рекомендуется взимать плату в валюте ваших клиентов, чтобы увеличить объем продаж и избежать комиссии за обмен валюты для ваших клиентов.','PayPal recommends using the Gold button since it is widely known as their brand color. However, if that does not suit your theme, you can choose a different color.'=>'PayPal рекомендует использовать золотую кнопку, поскольку она широко известна как их фирменный цвет. Однако, если это не соответствует вашей теме, вы можете выбрать другой цвет.','Gold'=>'Золото','Choose the width of PayPal Smart Buttons. It can be anywhere between 150px to 750px. Leave this empty if you want the buttons to take the full width of the form up to the 750px limit.'=>'Выберите ширину смарт-кнопок PayPal. Он может быть где угодно между 150px и 750px. Оставьте это поле пустым, если вы хотите, чтобы кнопки занимали всю ширину формы до предела в 750 пикселей.','Choose the height of PayPal Smart Buttons. It can be anywhere between 25px to 55px'=>'Выберите высоту смарт-кнопок PayPal. Он может быть где угодно между 25px и 55px','Choose your preferred shape from your PayPal Smart Buttons.'=>'Выберите желаемую форму с помощью смарт-кнопок PayPal.','Pill'=>'Таблетка','Eg. en_US'=>'Например. en_US','PayPal debug mode helps troubleshoot any issues. However, it\'s recommended to disable this in production as it causes a significant increase in the script size and performance decrease.'=>'Режим отладки PayPal помогает устранять любые неполадки. Однако рекомендуется отключить это в рабочей среде, так как это приводит к значительному увеличению размера скрипта и снижению производительности.','Redirection Option'=>'Опция перенаправления','Redirect on the same tab'=>'Перенаправление на ту же вкладку','Redirect on new tab and show thank you message on form page'=>'Перенаправление на новую вкладку и отображение благодарственного сообщения на странице формы','Redirect on new tab and hide form on the form page'=>'Перенаправление на новую вкладку и скрытие формы на странице формы','Horizontal'=>'Горизонтально','Vertical'=>'Вертикально','Layout'=>'Макет','Tagline'=>'Краткое описание','Choose a label for your PayPal button. Note that PayPal checkout doesn\'t allow a custom label for the PayPal button. You can only choose from the pre-defined labels.'=>'Выберите этикетку для вашей кнопки PayPal. Обратите внимание, что PayPal checkout не разрешает пользовательскую метку для кнопки PayPal. Вы можете выбирать только из заранее определенных меток.','Black'=>'Чёрный','Silver'=>'Серебряный','Select field'=>'Выбрать тип поля','Active Filters'=>'Активные фильтры','Authorization'=>'Авторизация','E.g., 16'=>'Например, 16','MetaData'=>'Метаданные','Minus'=>'Минус','PayPal'=>'PayPal','Please fill required fields'=>'Пожалуйста, заполните обязательные поля','Sum'=>'Сумма','Calculation value'=>'Расчетное значение','Choose the method you want to use to limit the number of votes.'=>'Выберите метод, который вы хотите использовать для ограничения количества голосов.','Formula Preview'=>'Предварительный просмотр формулы','Keyword: %s'=>'Ключевое слово: %s','Payments settings'=>'Настройки платежей','You can preview your form and check if the formula is generating expected results.'=>'Вы можете предварительно просмотреть формулу и проверить, дает ли формула ожидаемые результаты.','Key Type'=>'Тип ключа','Stripe account connected successfully. You can now add the Stripe field to your forms and start collecting payments.'=>'Учетная запись Stripe успешно подключена. Теперь вы можете добавить поле Stripe в свои формы и начать собирать платежи.','Please input test publishable key'=>'Пожалуйста, введите тестовый публикуемый ключ','Please input test secret key'=>'Пожалуйста, введите тестовый секретный ключ','Please input live publishable key'=>'Пожалуйста, введите живой публикуемый ключ','Please input live secret key'=>'Пожалуйста, введите секретный ключ live','You\'ve entered an invalid test secret key'=>'Вы ввели недопустимый секретный ключ теста','You\'ve entered an invalid live secret key'=>'Вы ввели недопустимый действующий секретный ключ','You\'ve entered an invalid test publishable key'=>'Вы ввели недопустимый тестовый публикуемый ключ','You\'ve entered an invalid live publishable key'=>'Вы ввели недопустимый живой публикуемый ключ','Choose whether to allow this field to be used in calculations or not. The value used in calculations is the same as the input value of this field.'=>'Выберите, разрешать ли использование этого поля в вычислениях или нет. Значение, используемое в вычислениях, совпадает с входным значением этого поля.','You can send custom meta data to Stripe. This would appear under the MetaData section of every payment. A maximum of 20 meta keys can be sent. The key name must be 20 characters or less, and the mapped data will be truncated to 500 characters as Stripe\'s requirements.'=>'Вы можете отправлять пользовательские метаданные в Stripe. Это будет отображаться в разделе метаданных каждого платежа. Можно отправить не более 20 мета-ключей. Имя ключа должно содержать не более 20 символов, а отображаемые данные будут сокращены до 500 символов в соответствии с требованиями Stripe.','Enable TinyMCE editor to allow the formatted text.'=>'Включите редактор TinyMCE, чтобы разрешить форматированный текст.','Got It'=>'Понял это','You can have only one Stripe field in your form for Stripe to work accurately. Please delete the existing Stripe field to add a new one.'=>'В вашей форме может быть только одно поле Stripe, чтобы Stripe работала точно. Пожалуйста, удалите существующее поле Stripe, чтобы добавить новое.','You can have only one captcha field in your form for captcha to work accurately. Please delete the existing captcha field to add a new one.'=>'У вас может быть только одно поле captcha в вашей форме, чтобы captcha работала точно. Пожалуйста, удалите существующее поле captcha, чтобы добавить новое.','Calculation values are required!'=>'Расчетные значения обязательны!','Please, connect your Stripe account first!'=>'Пожалуйста, сначала подключите свой аккаунт Stripe!','Calculation formula is required!'=>'Требуется формула расчета!','Limit Min value should be less than Max value.'=>'Предельное минимальное значение должно быть меньше максимального значения.','Submission Files'=>'Файлы отправки','If your form has file upload field(s), choose whether to delete the file(s) related to a submission when that submission gets deleted.'=>'Если в вашей форме есть поля для загрузки файлов, выберите, следует ли удалять файлы, связанные с отправкой, когда эта отправка будет удалена.','Assign a calculation value to each option. These values will not be shown on the form. You can assign only a numeric value.'=>'Присвойте каждому параметру расчетное значение. Эти значения не будут показаны в форме. Вы можете присвоить только числовое значение.','Calculation value is required!'=>'Требуется расчетное значение!','Delete MetaData'=>'Удаление метаданных','Add Custom Meta'=>'Добавить пользовательскую Мету','No custom meta data created yet. Click on "+ Add Custom to create custom meta and map form fields to it.'=>'Пользовательские метаданные еще не созданы. Нажмите на "+ Добавить пользовательский, чтобы создать пользовательский мета-файл и сопоставить с ним поля формы.','Submission limit'=>'Ограничение на отправку','Voting Limit'=>'Лимит голосования','Choose whether you want to limit the number of votes per users and how do you want to impose that limit. '=>'Выберите, хотите ли вы ограничить количество голосов на одного пользователя и как вы хотите ввести это ограничение. ','Votes per user'=>'Голоса за пользователя','By default, a user can only vote once on a poll. However, you can allow the users to vote multiple times and also specify the time after which a user can vote again.'=>'По умолчанию пользователь может проголосовать в опросе только один раз. Однако вы можете разрешить пользователям голосовать несколько раз, а также указать время, по истечении которого пользователь может проголосовать снова.','User IP'=>'IP-адрес пользователя','Browser Cookie'=>'Файл cookie браузера','%s does not exist in your form. Please insert a valid field from the merged tags option.'=>'%s не существует в вашей форме. Пожалуйста, вставьте допустимое поле из опции объединенные теги.','Infinity calculation result.'=>'Результат вычисления бесконечности.','Calculation Formula'=>'Формула расчета','Add Form Fields'=>'Добавление полей формы','Open list of fields'=>'Открыть список полей','Open parenthesis'=>'Открытые круглые скобки','Close parenthesis'=>'Закрыть круглые скобки','Remove this keyword'=>'Удалите это ключевое слово','From ID: %s'=>'От идентификатора: %s','To ID: %s'=>'К идентификатору: %s','Live Secret Key'=>'Живой Секретный Ключ','Are you sure you want to disconnect your PayPal Account? This will affect the forms using the PayPal field.'=>'Вы уверены, что хотите отключить свою учетную запись PayPal? Это повлияет на формы, использующие поле PayPal.','Default charge currency'=>'Валюта платежа по умолчанию','Use Stripe Checkout to process payments in your forms.'=>'Используйте Stripe Checkout для обработки платежей в ваших формах.','Failed to load Stripe Library, possibly conflict with other plugins. Please contact our support .'=>'Не удалось загрузить библиотеку Stripe, возможно, конфликт с другими плагинами. Пожалуйста, свяжитесь с нашей службой поддержки.','Connect your Stripe account with Forminator to use Stripe field for processing payments in your forms.'=>'Подключите свою учетную запись Stripe к Forminator, чтобы использовать поле Stripe для обработки платежей в ваших формах.','Connect Stripe Account'=>'Подключить учетную запись Stripe','Connect To Stripe'=>'Подключение к Stripe','Publishable Key'=>'Доступный для публикации Ключ','Disconnect Stripe Account'=>'Отключить учетную запись Stripe','Choose the default charge currency for your Stripe payments. You can override this while setting up the Stripe field in your forms.'=>'Выберите валюту начисления по умолчанию для ваших платежей Stripe. Вы можете переопределить это при настройке поля Stripe в ваших формах.','Test Publishable Key'=>'Тестовый публикуемый ключ','Enter your test publishable key'=>'Введите свой тестовый публикуемый ключ','Test Secret Key'=>'Тестовый Секретный ключ','Enter your test secret key'=>'Введите свой тестовый секретный ключ','Live Publishable Key'=>'Живой Публикуемый Ключ','Enter your live publishable key'=>'Введите свой живой публикуемый ключ','Enter your live secret key'=>'Введите свой живой секретный ключ','Submission Date Range: %1$s to %2$s'=>'Диапазон дат отправки: от %1$s до %2$s','Multiply'=>'Умножение','Option labels are required!'=>'Опционные этикетки обязательны!','Enter your Stripe API keys below to connect your account. You can grab your API keys from %1$shere%2$s.'=>'Введите ниже ключи Stripe API для подключения вашего аккаунта. Вы можете получить свои API ключи от %1$shere%2$s.','To be able to use Stripe Payments feature please upgrade your PHP to %1$sversion %2$s%3$s or above.'=>'Чтобы иметь возможность использовать функцию Stripe Payments, пожалуйста, обновите ваш PHP до версии %1$sversion %2$s%3$s или выше.','Configure'=>'Настроить','Connect'=>'Подключить','Divide'=>'Разделять','Danish (da)'=>'Датский (da)','E.g. 20.00'=>'Например, 20.00','Finnish (fi)'=>'Финский (fi)','Fixed amount'=>'Фиксированная сумма','French (fr)'=>'Французский (fr)','German (de)'=>'Немецкий (de)','Italian (it)'=>'Итальянский (it)','Mode of payment'=>'Способ оплаты','Spanish (es)'=>'Испанский (es)','Swedish (sv)'=>'Шведский (sv)','Test'=>'Тест','Variable'=>'Переменная','Variable amount'=>'Переменная сумма','Choose whether to allow this field to be used in calculations or not.'=>'Выберите, разрешать ли использование этого поля в вычислениях или нет.','Payment amount'=>'Сумма платежа','A currency field can be used to take user-defined payments such as donations and calculation field can be used to charge a calculated value based on a formula.'=>'Поле валюты можно использовать для приема определяемых пользователем платежей, таких как пожертвования, а поле расчета можно использовать для начисления расчетного значения на основе формулы.','Display the search box in a dropdown'=>'Отобразите поле поиска в выпадающем списке','Limit Submission'=>'Ограничить подачу','You can limit submissions of each option to a certain number, and once an option reaches the submission limit, we\'ll hide that option from the dropdown list.'=>'Вы можете ограничить отправку каждого варианта определенным числом, и как только какой-либо вариант достигнет предела отправки, мы скроем его из выпадающего списка.','English (en)'=>'Английский (ru)','Simplified Chinese (zh)'=>'Упрощенный китайский (zh)','Dutch (nl)'=>'Голландский (nl)','Japanese (ja)'=>'Японский (ja)','Norwegian (no)'=>'Норвежский (нет)','We recommend using Test mode to ensure the payments are working as expected and when you are ready to start collecting live payments, switch to Live payments mode. '=>'Мы рекомендуем использовать тестовый режим, чтобы убедиться, что платежи работают должным образом, и когда вы будете готовы начать получать текущие платежи, переключитесь в режим текущих платежей. ','Enter your payment description here'=>'Введите описание вашего платежа здесь','Search'=>'Поиск','In %s'=>'В %s','You can set a limit for your options in the LABELS tab. Options for which limit field is left empty can have unlimited submissions.'=>'Вы можете установить ограничение для своих параметров на вкладке ЭТИКЕТКИ. Варианты, для которых поле ограничения оставлено пустым, могут иметь неограниченное количество отправлений.','Custom Fields'=>'Произвольные поля','Fixed'=>'Фиксировано','Live'=>'В реальном времени','Amount'=>'Сумма','Arrows color'=>'Цвет стрелок','Calculations'=>'Расчеты','Default state colors'=>'Цвета состояния по умолчанию','Dot'=>'Точка','E.g. 01'=>'Например, 01','Field Type'=>'Тип поля','Header background'=>'Фон заголовка','Navigation'=>'Навигация','Page number color'=>'Цвет номера страницы','Payment Status'=>'Статус платежа','Payments'=>'Платежи','Read-only'=>'Только для чтения','Response Message'=>'Ответное сообщение','Submit Message'=>'Отправить сообщение','Suffix color'=>'Цвет суффикса','Table cell color'=>'Цвет ячейки таблицы','Calendar Basics'=>'Основы календаря','Calendar Table'=>'Календарная таблица','Choose how you want the form to behave when you are collecting payments.'=>'Выберите, как вы хотите, чтобы форма вела себя при сборе платежей.','Container BG'=>'Контейнер BG','Delete uploaded file'=>'Удалить загруженный файл','Error message BG'=>'Сообщение об ошибке BG','Response Error'=>'Ошибка ответа','Successful response message will be displayed after form submission succeeds.'=>'Сообщение об успешном ответе будет отображено после успешной отправки формы.','Table cell BG'=>'Ячейка таблицы BG','Table cell border'=>'Граница ячейки таблицы','Response Success'=>'Успешный ответ','Error response message will be displayed after form submission fails.'=>'Сообщение об ошибке будет отображено после сбоя отправки формы.','Pagination Progress Bar'=>'Индикатор выполнения разбивки на страницы','Fields Basics'=>'Основы полей','Input Extras'=>'Дополнительные входные данные','Button Next'=>'Кнопка Далее','Table head color'=>'Цвет головки стола','Option background'=>'Фон опции','Required asterisk'=>'Обязательная звездочка','Error message color'=>'Цвет сообщения об ошибке','Global error color'=>'Глобальный цвет ошибки','This color will be used when fields throw an error as text color, border color, etc.'=>'Этот цвет будет использоваться, когда поля выдают ошибку в виде цвета текста, цвета границы и т.д.','Option border'=>'Граница опции','Progress bar BG'=>'Индикатор выполнения BG','Progress status BG'=>'Статус прогресса BG','Current state colors'=>'Цвета текущего состояния','Fields Error Message'=>'Сообщение об ошибке полей','Input Suffix'=>'Входной суффикс','Pagination Buttons'=>'Кнопки разбивки на страницы','Require SSL certificate to submit this form'=>'Требуется SSL-сертификат для отправки этой формы','Enabling this will allow the form submission on an HTTPS page only. It is highly recommended to embed the form with payments action on an HTTPS page to avoid any man in the middle attack.'=>'Включение этого параметра позволит отправлять формы только на странице HTTPS. Настоятельно рекомендуется встроить форму с платежным действием на страницу HTTPS, чтобы избежать атаки "человек посередине".','By default, the calculation field is read-only. You can also hide the field if you don\'t want to show the calculated result on the form.'=>'По умолчанию поле расчета доступно только для чтения. Вы также можете скрыть поле, если не хотите показывать вычисленный результат в форме.','You can\'t set visibility conditions for a hidden field. Uncheck the Hidden option in the settings tab and come back here to define visibility rules.'=>'Вы не можете установить условия видимости для скрытого поля. Снимите флажок "Скрытый" на вкладке "Настройки" и вернитесь сюда, чтобы определить правила видимости.','Choose the currency to display on the field. If you are going to collect payments based on this field, it is recommended to keep this currency same as your charge currency to avoid any confusions.'=>'Выберите валюту для отображения в поле. Если вы собираетесь получать платежи на основе этого поля, рекомендуется использовать эту валюту в той же валюте, что и валюта вашего платежа, чтобы избежать каких-либо недоразумений.','Restrict the value that your users can enter in this field within a custom range.'=>'Ограничьте значение, которое ваши пользователи могут вводить в это поле, в пределах настраиваемого диапазона.','Payment Mode'=>'Режим оплаты','Transaction ID'=>'Идентификатор транзакции','Failed to calculate field.'=>'Не удалось вычислить поле.','This field is required.'=>'Это поле является обязательным для заполнения.','Stripe not available, please check your WordPress installation for PHP Version and plugin conflicts.'=>'Stripe недоступен, пожалуйста, проверьте вашу установку WordPress на наличие версии PHP и конфликтов плагинов.','Some error has occurred while connecting to your Stripe account. Please resolve the following errors and try to connect again.'=>'Произошла какая-то ошибка при подключении к вашей учетной записи Stripe. Пожалуйста, устраните следующие ошибки и попробуйте подключиться снова.','Loading more results…'=>'Загрузка дополнительных результатов…','No results found'=>'Никаких результатов не найдено','Searching…'=>'Поиск…','The results could not be loaded.'=>'Результаты не удалось загрузить.','SSL required to submit this form, please check your URL.'=>'Для отправки этой формы требуется SSL, пожалуйста, проверьте свой URL-адрес.','vote(s)'=>'голосование (голоса)','Mode'=>'Режим','Arrows background'=>'Фон стрелки','Button Back'=>'Кнопка назад','Stripe'=>'Stripe','Limit'=>'Лимит','E.g. 5'=>'Например, 5','Reset'=>'Сброс','seconds.'=>'секунд.','New Poll submission for {poll_name}'=>'Представление нового опроса для {poll_name}','New Quiz Submission for {quiz_name}'=>'Новая заявка на участие в викторине для {quiz_name}','Number of Forms'=>'Количество форм','Number of Polls'=>'Количество опросов','Options without a value will be treated as empty options'=>'Параметры без значения будут рассматриваться как пустые параметры','This field shouldn\'t be empty.'=>'Это поле не должно быть пустым.','Use {{strong}}%UserAnswer%{{/strong}} and {{strong}}%CorrectAnswer%{{/strong}} to display the answer chosen by the user and the correct answer for each question respectively.'=>'Используйте {{strong}}%UerAnswer%{{{/strong}} и {{{strong}}%CorrectAnswer%{{{/strong}} для отображения ответа, выбранного пользователем, и правильного ответа на каждый вопрос соответственно.','You have a new poll submission: <br/><br/>{poll_answer}<br/><br/>Current results: <br/>{poll_result} <br/>---<br/> This message was sent from {site_url}.'=>'У вас новый опрос: <br/><br/>{poll_answer}<br/><br/>Текущие результаты: <br/>{poll_result} <br/>---<br/> Это сообщение было отправлено с {site_url}.','RESET'=>'Сброс','Auto-close success message after'=>'Автоматическое закрытие сообщения об успешном завершении после','Your default setting value is to '=>'Ваше значение настройки по умолчанию равно ','High Contrast Mode'=>'Режим высокой контрастности','Number of Quizzes'=>'Количество викторин','Uninstallation'=>'Удаление','When you uninstall this plugin, what do you want to do with your plugin\'s settings and data?'=>'Когда вы удалите этот плагин, что вы хотите сделать с настройками и данными вашего плагина?','Preserve'=>'Сохранить','Reset Plugin'=>'Сброс плагина','Needing to start fresh? Use this setting to roll back to the default plugin state.'=>'Вам нужно начать все сначала? Используйте этот параметр для отката к состоянию плагина по умолчанию.','Are you sure you want to reset the plugin to its default state?'=>'Вы уверены, что хотите вернуть плагин в состояние по умолчанию?','Note: This will delete all the form/polls/quizzes you currently have and revert all settings to their default state.'=>'Примечание: Это приведет к удалению всех имеющихся у вас форм / опросов / опросов и возврату всех настроек к их состоянию по умолчанию.','Submissions settings'=>'Настройки отправлений','Submission Time'=>'Время подачи заявки','Please enter a value greater than or equal to %1$s for %2$s.'=>'Пожалуйста, введите значение, большее или равное %1$s для %2$s.','Please enter a value less than or equal to %1$s for %2$s.'=>'Пожалуйста, введите значение, меньшее или равное %1$s для %2$s.','At least one field must be filled out to submit the form.'=>'Для отправки формы необходимо заполнить хотя бы одно поле.','Please enter a valid number for %1$s.'=>'Пожалуйста, введите действительное число для %1$s.','Please enter a value greater than or equal to 0 for %1$s.'=>'Пожалуйста, введите значение, большее или равное 0 для %1$s.','Please enter a value less than or equal to 59 for %1$s.'=>'Пожалуйста, введите значение, меньшее или равное 59 для %1$s.','You can import this %1$s in Forminator %2$s%3$s%4$s or above. The %5$s may break on a version lower than your install.'=>'Вы можете импортировать этот %1$s в Forminator %2$s%3$s%4$s или выше. Значение %5$s может сломаться на версии ниже, чем ваша установка.','Final count message will appear after the quiz is complete. Use {{strong}}%YourNum%{{/strong}} to display number of correct answers and {{strong}}%Total%{{/strong}} for total number of questions.'=>'Окончательное сообщение о подсчете появи