		<strong>Data</strong>'=>'По умолчанию Forminator сохраняет ответы на все тесты и <strong>навсегда</strong>. Вы можете изменить эту настройку в разделе "Настройки<strong>"</strong> <strong>программы Forminator</strong>.
		<strong>Данные</strong>','No data to be send to GoogleSheet'=>'Нет данных для отправки в GoogleSheet','Quiz Privacy'=>'Конфиденциальность викторины','When visitors or users answer a quiz we retain the <strong>answers</strong> data for 30 days and then remove it from our system.'=>'Когда посетители или пользователи отвечают на вопросы викторины, мы сохраняем данные <strong>ответов</strong> в течение 30 дней, а затем удаляем их из нашей системы.','When visitors or users submit a quiz\'s answer, we capture <strong>NO Personally Identifiable Information</strong>.'=>'Когда посетители или пользователи отправляют ответ на тест, мы фиксируем <strong>НЕТ Персонально идентифицируемой информации</strong>.','Question : '=>'Вопрос : ','Lao People\'s Democratic Republic'=>'Лаосская Народно-Демократическая Республика','Correct Answers'=>'Правильные ответы','Total Answers'=>'Всего ответов','Successfully connected to your quiz'=>'Успешно подключился к вашей викторине','Google Sheets failed to process submitted data. Please check your quiz and try again'=>'Google Sheets не удалось обработать предоставленные данные. Пожалуйста, проверьте свой тест и попробуйте еще раз','The update to your settings for this quiz failed, check the form input and try again.'=>'Не удалось обновить настройки для этого теста, проверьте ввод формы и повторите попытку.','Deactivate Google Sheets Integration from this Quiz.'=>'Отключите интеграцию с Google Таблицами из этого теста.','Successfully created spreadsheet and connected to your quiz'=>'Успешно созданная электронная таблица и подключение к вашему тесту','Deactivate Google Sheets Integration from this quiz.'=>'Отключите интеграцию с Google Таблицами из этого теста.','Invalid Quiz Settings of GoogleSheet'=>'Неверные настройки теста в GoogleSheet','No active GoogleSheet connection found in this quiz'=>'В этом тесте не найдено активного подключения к GoogleSheet','By default sent message will include Quiz Answer and Quiz Result as attachment using Forminator Format to ease you up, more information about attachment can be found %shere%s.'=>'По умолчанию отправленное сообщение будет содержать ответ на тест и результат теста в виде вложения с использованием формата Forminator для упрощения работы, более подробную информацию о вложении можно найти %shere%s.','Correct : '=>'Правильно : ','Correct Answers : '=>'Правильные ответы : ','Total Answers : '=>'Всего ответов : ','Deactivate this Trello Integration from this Quiz.'=>'Отключите эту интеграцию с Trello из этого теста.','Quiz name cannot be empty.'=>'Имя теста не может быть пустым.','E.g., My Awesome Quiz'=>'Например, Моя потрясающая викторина','Knowledge Quiz'=>'Тест на знание','Test the knowledge of your visitors on a subject and final score is calculated based on number of right answers. E.g., Test your music knowledge.'=>'Проверьте знания ваших посетителей по предмету, и итоговый балл рассчитывается на основе количества правильных ответов. Например, проверьте свои знания музыки.','Personality Quiz'=>'Личностный тест','Show different outcomes depending on the visitor\'s answers. There are no wrong answers. E.g., Which superhero are you?'=>'Показывайте разные результаты в зависимости от ответов посетителя. Неправильных ответов не бывает. например, какой ты супергерой?','Label color'=>'Цвет этикетки','View Results Link'=>'Ссылка для просмотра результатов','How long do you want to retain this quiz\'s submissions for?'=>'Как долго вы хотите сохранять материалы этого теста?','Answer result message'=>'Сообщение о результате ответа','Quiz result color'=>'Цвет результата теста','Answer - Checkbox'=>'Ответ - Флажок','Retake Button'=>'Кнопка Пересдачи','Quiz Description'=>'Описание викторины','Answer Result Message'=>'Сообщение о результате ответа','Social Share Title'=>'Название социальной акции','Choose one of the pre-defined sizes we have for social share icons.'=>'Выберите один из заранее определенных размеров, которые у нас есть для значков социальных сетей.','Content background'=>'Предыстория контента','Retake'=>'Пересдача','Let\'s add the different personalities. Each of the following personality is a possible outcome of your quiz. In case of a tie, the personality is chosen as per their order below.'=>'Давайте добавим разные личности. Каждая из следующих личностей - это возможный результат вашего теста. В случае ничьей личность выбирается в соответствии с их порядком, приведенным ниже.','Reorder the personalities to set the priority order.'=>'Измените порядок персоналий, чтобы установить приоритетный порядок.','Define the different personalities possible as the outcome of your quiz here.'=>'Определите различные личности, которые могут стать результатом вашего теста здесь.','Answer Input'=>'Ввод ответа','This field is required!'=>'Это поле обязательно для заполнения!','Choose how you want to handle the quizzes submissions.'=>'Выберите, как вы хотите обрабатывать отправленные викторины.','How long do you want to retain the quiz submissions for?'=>'Как долго вы хотите сохранять материалы для викторины?','Quiz with id %d could not be found'=>'Не удалось найти тест с идентификатором %d','Failed to submit quiz because of an addon, please check your quiz and try again'=>'Не удалось отправить тест из-за дополнения, пожалуйста, проверьте свой тест и повторите попытку','Aruba'=>'Aruba','British Indian Ocean Territory'=>'Британская территория в Индийском океане','China, People\'s Republic of'=>'Китай, Народная Республика','France, Metropolitan'=>'Франция, Метрополитен','French South Territories'=>'Французские Южные территории','Heard Island And Mcdonald Island'=>'Остров Херд и остров Макдональд','Korea, Democratic People\'s Republic of'=>'Корея, Народно-Демократическая Республика','Korea, Republic of'=>'Корея, Республика Корея','Martinique'=>'Martinique','Mayotte'=>'Mayotte','Saint Pierre & Miquelon'=>'Saint Pierre & Miquelon','South Georgia and South Sandwich'=>'Южная Джорджия и Южный Сэндвич','Stateless Persons'=>'Лица без гражданства','Svalbard and Jan Mayen'=>'Шпицберген и Ян - Майен','Taiwan, Republic of China'=>'Тайвань, Китайская Республика','Turks And Caicos Islands'=>'Острова Теркс и Кайкос','US Minor Outlying Islands'=>'Малые отдаленные острова США','Wallis And Futuna Islands'=>'Острова Уоллис и Футуна','Yemen Arab Rep.'=>'Представитель Йеменской арабской республики .','Yemen Democratic'=>'Демократический Йемен','Answer : '=>'Ответьте : ','By default Forminator Forms can be configured to connect with these third parties:'=>'По умолчанию Forminator Forms может быть настроен для связи с этими третьими сторонами:','Quiz submissions disabled.'=>'Отправка материалов для викторины отключена.','Which quizzes are collecting personal data?'=>'Какие тесты собирают персональные данные?','If you use Forminator PRO to create and embed any quizzes on your website, you may need to mention it here to properly distinguish it from other quizzes.'=>'Если вы используете Forminator PRO для создания и встраивания каких-либо тестов на свой веб-сайт, вам может потребоваться упомянуть об этом здесь, чтобы правильно отличить его от других тестов.','In this section you should note what personal data you collected including which quizzes are available. You should also explain why this data is needed. Include the legal basis for your data collection and note the active consent the user has given.'=>'В этом разделе вы должны указать, какие персональные данные вы собрали, в том числе какие тесты доступны. Вы также должны объяснить, зачем нужны эти данные. Укажите правовую основу для сбора ваших данных и обратите внимание на активное согласие, данное пользователем.','All collected data might be shown publicly and we send it to our workers or contractors to perform necessary actions based on answers.'=>'Все собранные данные могут быть показаны публично, и мы отправляем их нашим работникам или подрядчикам для выполнения необходимых действий на основе ответов.','If your quizzes utilize either built-in or external third party services, in this section you should mention any third parties and its privacy policy.'=>'Если ваши тесты используют встроенные или внешние сторонние сервисы, в этом разделе вы должны указать любые третьи стороны и их политику конфиденциальности.','By default Forminator Quizzes can be configured to connect with these third parties:'=>'По умолчанию Тесты Forminator могут быть настроены для связи с этими третьими сторонами:','%1$sCorrect Answers%2$s : %3$d'=>'%1$sCorrect Ответы%2$s : %3$d','Forminator Quizzes'=>'Викторины Forminator','No Quiz Settings available for %1$s'=>'Настройки викторины недоступны для %1$s','By default this quiz will inherit the fonts your theme uses. You can override these fonts with custom ones from {{link}}Bunny Fonts{{/link}}.'=>'По умолчанию этот тест наследует шрифты, которые использует ваша тема. Вы можете заменить эти шрифты пользовательскими из {{link}}Bunny Fonts{{/link}}.','%1$sTotal Question Answered%2$s : %3$d'=>'%1$sОбщий ответ на вопрос%2$s: %3$d','Answer Label'=>'Этикетка ответа','Deactivate this Slack Integration from this Quiz.'=>'Отключите эту Slack-интеграцию из этого теста.','Social Share Icons'=>'Значки поделиться в соцсетях','Montserrat'=>'Montserrat','Social Share'=>'Поделиться в соцсетях','Correct Answer'=>'Правильный ответ','Edit Question'=>'Редактировать вопрос','Messages'=>'Сообщения','Personalities'=>'Личности','Real Time'=>'В реальном времени','Add as many emails as you like'=>'Добавьте столько писем, сколько хотите','Choose whether to display the correct answer as the user answers each question or after the quiz is submitted.'=>'Выберите, отображать ли правильный ответ при ответе пользователя на каждый вопрос или после отправки теста.','Custom CSS Classes'=>'Пользовательские классы CSS','Delete Question'=>'Удалить вопрос','Open field settings'=>'Настройки открытого поля','Page caching plugins serve a static HTML version of the page which can cause issues to your dynamic quizzes. By enabling this, we\'ll use {{strong}}DONOTCACHEPAGE{{/strong}} constant to prevent pages with this quiz on it from being cached.'=>'Плагины кэширования страниц служат статической HTML-версией страницы, которая может вызвать проблемы в ваших динамических тестах. Включив это, мы будем использовать константу {{/strong}}DONOTCACHEPAGE{{{/strong}}, чтобы предотвратить кэширование страниц с этим тестом.','Question text?'=>'Текст вопроса?','Select Personality'=>'Выберите Личность','Want to enhance how the result will look when shared on Social Media? {{link}}SmartCrawl{{/link}} OpenGraph and Twitter Card support lets you choose how your content looks when it\'s shared on social media.'=>'Хотите улучшить то, как будет выглядеть результат, когда о нем расскажут в социальных сетях? {{link}}SmartCrawl{{/link}} Поддержка OpenGraph и Twitter Card позволяет выбирать, как будет выглядеть ваш контент, когда он публикуется в социальных сетях.','Which superhero are you?'=>'Какой ты супергерой?','Quiz Result'=>'Результат теста','Choose a pre-made style for your quiz and further customize it\'s appearance below.'=>'Выберите готовый стиль для своего теста и дополнительно настройте его внешний вид ниже.','Option Unselected'=>'Невыбранный параметр','Option Selected'=>'Выбранная опция','You have opted for no stylesheet to be enqueued. The quiz will inherit styles from your theme\'s CSS.'=>'Вы выбрали, чтобы таблица стилей не ставилась в очередь. Тест унаследует стили из CSS вашей темы.','Choose the copy of the messages for the correct and wrong answers and also for the final score count.'=>'Выберите копию сообщений для правильных и неправильных ответов, а также для подсчета итогового балла.','Correct Answer Message'=>'Сообщение с правильным ответом','Incorrect Answer Message'=>'Сообщение о неправильном ответе','Final Count Message'=>'Сообщение об Окончательном подсчете','Quiz Answer'=>'Ответ на тест','Load quiz using AJAX'=>'Загрузка викторины с помощью AJAX','Enabling this feature will load the quiz via AJAX after the page has loaded up, effectively speeding up your page load time. This method can also (in most cases) avoid page caching issues with your quiz.'=>'Включение этой функции позволит загрузить тест через AJAX после загрузки страницы, что значительно ускорит время загрузки страницы. Этот метод также может (в большинстве случаев) избежать проблем с кэшированием страниц в вашем тесте.','Prevent page caching on quiz pages'=>'Запретить кэширование страниц на страницах викторины','On Submission'=>'О представлении','Choose whether you want to allow the quiz participants to share their results on social media.'=>'Выберите, хотите ли вы разрешить участникам викторины делиться своими результатами в социальных сетях.','Social Sharing Platforms'=>'Платформы социального обмена','A quiz without questions is not going to be very useful… Add your questions above!'=>'Викторина без вопросов будет не очень полезной… Добавляйте свои вопросы выше!','Give your quiz a name'=>'Дайте своему тесту название','You need to save this quiz before using integrations.'=>'Вам необходимо сохранить этот тест перед использованием интеграции.','Start by adding a title for your quiz to let your visitors know what this quiz is all about.'=>'Начните с добавления заголовка для вашего теста, чтобы ваши посетители знали, о чем этот тест.','Choose a title to grab the attention of your visitors.'=>'Выберите заголовок, который привлечет внимание ваших посетителей.','Feature Image'=>'Характерное изображение','Upload a nice feature image for your quiz.'=>'Загрузите красивое функциональное изображение для своей викторины.','Upload Feature Image'=>'Загрузить изображение объекта','Provide your visitors with more information about your quiz.'=>'Предоставьте своим посетителям больше информации о вашей викторине.','Deleting this question will remove its value from the existing submissions as well.'=>'Удаление этого вопроса также приведет к удалению его значения из существующих материалов.','Add Personality'=>'Добавьте индивидуальности','Edit Personality'=>'Редактировать личность','E.g. Iron Man'=>'Например, Железный Человек','Please validate your fields!'=>'Пожалуйста, подтвердите свои поля!','Publishing quiz…'=>'Викторина по публикации…','Great work! Please hold tight a few moments while we publish your quiz to the world.'=>'Отличная работа! Пожалуйста, подождите несколько минут, пока мы опубликуем ваш тест для всего мира.','Your quiz is now ready to be embedded into a page or template of your choice. Simply copy and paste the shortcode below to display it!'=>'Теперь ваш тест готов для встраивания в страницу или шаблон по вашему выбору. Просто скопируйте и вставьте приведенный ниже шорткод, чтобы отобразить его!','Button Processing Text'=>'Кнопка Обработки текста','This text will appear as button text while the quiz is being submitted.'=>'Этот текст будет отображаться в виде текста кнопки во время отправки теста.','E.g. form-submit-btn'=>'Например. форма-отправить-btn','These will be output as you see them here. To add multiple classes, separate them with a space. For example, "form-submit-btn button" will add two classes "form-submit-btn" and "button".'=>'Они будут выведены в том виде, в каком вы их видите здесь. Чтобы добавить несколько классов, разделите их пробелом. Например, "кнопка form-submit-btn" добавит два класса "form-submit-btn" и "button".','Optionally, you can send a notification email to nominated email accounts when quiz submissions come in.'=>'При желании вы можете отправить уведомление по электронной почте на назначенные учетные записи электронной почты при поступлении материалов викторины.','Social Sharing'=>'Обмен в соцсетях','Intro'=>'Введение','Poll Results'=>'Результаты опроса','Current Poll Result'=>'Текущий результат опроса','Submitted Vote'=>'Представленный голос','Successfully connected to your poll'=>'Успешно подключился к вашему опросу','We use Slack to manage our integration data. Their privacy policy can be found here : https://slack.com/privacy-policy.'=>'Мы используем Slack для управления данными интеграции. С их политикой конфиденциальности можно ознакомиться здесь: https://slack.com/privacy-policy.','Google Sheets failed to process submitted data. Please check your poll and try again'=>'Google Sheets не удалось обработать предоставленные данные. Пожалуйста, проверьте свой опрос и повторите попытку','The update to your settings for this poll failed, check the form input and try again.'=>'Не удалось обновить настройки для этого опроса, проверьте ввод формы и повторите попытку.','Deactivate this Google Sheets Integration from this Poll.'=>'Отключите эту интеграцию с Google Таблицами из этого опроса.','Successfully created spreadsheet and connected to your poll'=>'Успешно созданная электронная таблица и подключение к вашему опросу','Invalid Poll Settings of GoogleSheet'=>'Неверные настройки опроса в GoogleSheet','No active GoogleSheet connection found in this poll'=>'В этом опросе не обнаружено активного подключения к GoogleSheet','Vote'=>'Голосовать','By default sent message will include Poll Answer and Poll Results as attachment using Forminator Format to ease you up, more information about attachment can be found %shere%s.'=>'По умолчанию отправленное сообщение будет содержать ответ на опрос и результаты опроса в виде вложения с использованием формата Forminator для удобства, более подробную информацию о вложении можно найти %shere%s.','Deactivate this Trello Integration from this Poll.'=>'Отключите эту интеграцию с Trello из этого опроса.','Please specify integration name.'=>'Пожалуйста, укажите название интеграции.','There was a problem saving the poll'=>'Возникла проблема с сохранением результатов опроса','Trello. Enabled when you activated and set up Trello on Integrations settings.'=>'Трелло. Включено, когда вы активировали и настроили Trello в настройках интеграции.','Poll submissions disabled.'=>'Отправка опросов отключена.','Deactivate this Slack Integration from this Poll.'=>'Отключите эту Slack интеграцию из этого опроса.','Slack. Enabled when you activated and set up Slack on Integrations settings.'=>'Slack. Включено, когда вы активировали и настроили настройки Slack для интеграции.','Allow Multiple'=>'Разрешить несколько','Answer Text'=>'Текст ответа','Button Text'=>'Текст кнопки','Container'=>'Контейнер','Link color'=>'Цвет ссылки','Once'=>'Один раз','Pie Chart'=>'Круговая диаграмма','Upload image'=>'Загрузить изображение','Vote Count'=>'Подсчет голосов','A poll without answers isn’t going to be very useful… Add your answers above!'=>'Опрос без ответов не будет очень полезен... Добавьте свои ответы выше!','Choose how you want to display poll results to new submissions. You can customise colors in the {{link}}Appearance{{/link}} tab.'=>'Выберите способ отображения результатов опроса для новых заявок. Вы можете настроить цвета на вкладке {{ссылка}}Внешний вид{{{/ссылка}}.','Display the numbers of votes on bar chart results'=>'Отображение количества голосов на результатах гистограммы','E.g., Blank Poll'=>'Например, Пустой опрос','Enable custom input'=>'Включить пользовательский ввод','Enable high contrast mode'=>'Включить режим высокой контрастности','Enter an optional description'=>'Введите необязательное описание','No Poll Settings available for %1$s'=>'Настройки опроса недоступны для %1$s','Page caching plugins serve a static HTML version of the page which can cause issues to your dynamic forms. By enabling this, we\'ll use {{strong}}DONOTCACHEPAGE{{/strong}} constant to prevent pages with this form on it from being cached.'=>'Плагины кэширования страниц служат статической HTML версией страницы, которая может вызвать проблемы с вашими динамическими формами. Включив это, мы будем использовать {{strong}}DONOTCACHEPAGE{{{/strong}} константу, чтобы предотвратить кэширование страниц с этой формой.','Page caching plugins serve a static HTML version of the page which can cause issues to your dynamic polls. By enabling this, we\'ll use {{strong}}DONOTCACHEPAGE{{/strong}} constant to prevent pages with this poll on it from being cached.'=>'Плагины кэширования страниц служат статической HTML версией страницы, которая может вызвать проблемы в ваших динамических опросах. Включив это, мы будем использовать константу {{/strong}}DONOTCACHEPAGE{{{/strong}} для предотвращения кэширования страниц с этим опросом.','Poll Answer'=>'Ответ на опрос','Poll Result'=>'Результат опроса','Poll answers can not be empty.'=>'Ответы на опрос не могут быть пустыми.','Poll name cannot be empty.'=>'Имя опроса не может быть пустым.','Remove custom input'=>'Удалить пользовательский ввод','Remove uploaded file'=>'Удалить загруженный файл','Remove uploaded image'=>'Удалить загруженное изображение','Results Display'=>'Отображение результатов','This image will appear under your main question and can be used to create polls based on an image.'=>'Это изображение появится под вашим основным вопросом и может быть использовано для создания опросов на основе изображения.','This will appear below the main question and can be used to further explain the main question.'=>'Это появится под основным вопросом и может быть использовано для дальнейшего объяснения основного вопроса.','Name your new poll, then let\'s start building!'=>'Назовите свой новый опрос, и тогда давайте начнем строить!','Adjust the default color combinations to match your theme styling.'=>'Настройте цветовые сочетания по умолчанию в соответствии с вашим стилем темы.','Rendering'=>'Рендеринг','Choose how you want your form to be rendered for users.'=>'Выберите, как вы хотите, чтобы ваша форма отображалась для пользователей.','Load form using AJAX'=>'Загрузить форму с помощью AJAX','Enabling this feature will load the form via AJAX after the page has loaded up, effectively speeding up your page load time. This method can also (in most cases) avoid page caching issues with your form.'=>'Включение этой функции приведет к загрузке формы через AJAX после загрузки страницы, что значительно ускорит время загрузки страницы. Этот метод также может (в большинстве случаев) избежать проблем с кэшированием страницы в вашей форме.','Prevent page caching on form pages'=>'Запретить кэширование страниц на страницах форм','Use default colors'=>'Используйте цвета по умолчанию','Choose a pre-made style for your poll and further customize it\'s appearance below.'=>'Выберите готовый стиль для своего опроса и дополнительно настройте его внешний вид ниже.','Choose how you want your poll to be rendered for users.'=>'Выберите, как вы хотите, чтобы ваш опрос отображался для пользователей.','Load poll using AJAX'=>'Загрузить опрос с помощью AJAX','Enabling this feature will load the poll via AJAX after the page has loaded up, effectively speeding up your page load time. This method can also (in most cases) avoid page caching issues with your poll.'=>'Включение этой функции приведет к загрузке опроса через AJAX после загрузки страницы, что значительно ускорит время загрузки страницы. Этот метод также может (в большинстве случаев) избежать проблем с кэшированием страницы при вашем опросе.','Prevent page caching on poll pages'=>'Запретить кэширование страниц на страницах опроса','Bar Graph'=>'Гистограмма','By default, submissions don\'t require the page to reload. If you are having issues you might want use the traditional method of reloading the page.'=>'По умолчанию для отправки сообщений не требуется перезагрузка страницы. Если у вас возникли проблемы, вы можете использовать традиционный метод перезагрузки страницы.','Reload Page'=>'Перезагрузить страницу','Answer options'=>'Варианты ответов','Start by adding the question you will be asking poll visitors to vote on.'=>'Начните с добавления вопроса, за который вы будете просить проголосовать посетителей опроса.','What is your main question?'=>'Каков ваш главный вопрос?','E.g. Why did the chicken cross the road?'=>'Например, почему курица перешла дорогу?','Feature Image (optional)'=>'Изображение объекта (необязательно)','Now add answers to your question that your users will use to vote with. Add as many as you like, just be careful to make sure each one is unique!'=>'Теперь добавьте ответы на свой вопрос, которые ваши пользователи будут использовать для голосования. Добавляйте столько, сколько захотите, только будьте осторожны, чтобы убедиться, что каждый из них уникален!','You need to save this poll before using integrations.'=>'Вам необходимо сохранить этот опрос перед использованием интеграции.','Publishing poll…'=>'Публикация опроса…','Your poll is now ready to be embedded into a page or template of your choice. Simply copy and paste the shortcode below to display it!'=>'Теперь ваш опрос готов для встраивания в страницу или шаблон по вашему выбору. Просто скопируйте и вставьте приведенный ниже шорткод, чтобы отобразить его!','Optionally, you can send a notification email to nominated email accounts when poll submissions come in.'=>'При желании вы можете отправить уведомление по электронной почте назначенным учетным записям электронной почты при поступлении материалов опроса.','By default we\'ll store all submissions in your database.'=>'По умолчанию мы будем хранить все отправленные материалы в вашей базе данных.','How long do you want to retain this poll\'s submissions for?'=>'Как долго вы хотите сохранять материалы этого опроса?','Your default setting value is to keep the submissions %s.'=>'Ваше значение настройки по умолчанию - сохранить отправленные %s.','Your default setting keep the IPs %s.'=>'В настройках по умолчанию сохраняйте значение IPs %s.','Leave the field blank to keep IPs forever.'=>'Оставьте поле пустым, чтобы сохранить IP-адреса навсегда.','Question Description'=>'Описание вопроса','View all forms'=>'Просмотр всех форм','View all polls'=>'Просмотр всех опросов','View all quizzes'=>'Просмотреть все тесты','How long do you want to retain the poll\'s submissions for?'=>'Как долго вы хотите сохранять материалы опроса?','Enable support for any accessibility enhancements available in the plugin interface.'=>'Включите поддержку любых улучшений доступности, доступных в интерфейсе плагина.','Increase the visibility and accessibility of elements and components to meet WCAG AAA requirements.'=>'Увеличьте видимость и доступность элементов и компонентов в соответствии с требованиями WCAG AAA.','Successfully disconnected from this module'=>'Успешно отключен от этого модуля','Failed to disconnected from this module'=>'Не удалось отсоединиться от этого модуля','This Addon does not have module settings available'=>'Этот аддон не имеет доступных настроек модуля','Poll with id %d could not be found'=>'Не удалось найти опрос с идентификатором %d','Failed to submit poll because of an addon, please check your poll and try again'=>'Не удалось отправить опрос из-за дополнения, пожалуйста, проверьте свой опрос и повторите попытку','ActiveCampaign. Enabled when you activated and set up ActiveCampaign on Integrations settings.'=>'Активная кампания. Включено, когда вы активировали и настроили ActiveCampaign в настройках интеграции.','Campaign Monitor. Enabled when you activated and set up Campaign Monitor on Integrations settings.'=>'Монитор кампании. Включено, когда вы активировали и настроили мониторинг кампаний в настройках интеграции.','Google Drive. Enabled when you activated and set up Google Drive on Integrations settings.'=>'Google Диск. Включено, когда вы активировали и настроили Google Диск в настройках интеграции.','Customize the button label used for submitting the users answer.'=>'Настройте этикетку кнопки, используемую для отправки ответа пользователя.','Accessibility settings'=>'Настройки доступности','Aweber. Enabled when you activated and set up Aweber on Integrations settings.'=>'Aweber. Включено, когда вы активировали и настроили Aweber в настройках интеграции.','Failed to disconnect %s from this module'=>'Не удалось отключить %s от этого модуля','Successfully disconnected %s from this module'=>'Успешно отключено %s от этого модуля','Accessibility'=>'Специальные возможности','Select image'=>'Выбрать изображение','Bulk Action'=>'Массовое действие','Clear Filters'=>'Очистить фильтры','Enter name'=>'Введите имя','Keyword'=>'Ключевое слово','Learn more'=>'Узнать больше','Modules'=>'Модули','Pick a date range'=>'Выберите диапазон дат','Sort Order'=>'Порядок сортировки','Sort by'=>'Сортировать по','View features'=>'Просмотр функций','+ %s other fields'=>'+ %s другие поля','Are you sure you wish to permanently delete this poll?'=>'Вы уверены, что хотите навсегда удалить этот опрос?','Are you sure you wish to permanently delete this quiz?'=>'Вы уверены, что хотите навсегда удалить этот тест?','Connect this integration'=>'Подключите эту интеграцию','E.g. search'=>'Например, поиск','Forms Privacy'=>'Формы Конфиденциальности','From Headers'=>'Из заголовков','Poll Privacy'=>'Конфиденциальность опроса','Select entry number %s'=>'Выберите номер записи %s','SmartCrawl Search Engine Optimization'=>'Поисковая оптимизация SmartCrawl','Specified Fields'=>'Указанные поля','This field cannot be empty.'=>'Это поле не может быть пустым.','modules per page'=>'модули на страницу','This %s is in draft state, so we\'ve paused collecting data until you publish it live.'=>'Этот %s находится в состоянии черновика, поэтому мы приостановили сбор данных до тех пор, пока вы не опубликуете их в реальном времени.','Delete Quiz'=>'Удалить тест','Keep'=>'Держать','IP Retention'=>'Сохранение IP-адреса','Choose how long to retain IP address before a submission is anonymized. Keep in mind that the IP address is being used in checking multiple votes from same user.'=>'Выберите, как долго сохранять IP-адрес, прежде чем отправка будет анонимизирована. Имейте в виду, что IP-адрес используется для проверки нескольких голосов от одного и того же пользователя.','View Stats'=>'Просмотр статистики','Show Submissions'=>'Показать материалы','Almost there!'=>'Почти на месте!','Select the form, poll or quiz module to view the corresponding submissions.'=>'Выберите модуль формы, опроса или викторины, чтобы просмотреть соответствующие материалы.','Submission Date Range'=>'Диапазон дат отправки','From ID'=>'От ID','To ID'=>'К ИДЕНТИФИКАТОРУ','Display Fields'=>'Отображаемые поля','Delete Submission'=>'Удалить отправку','Are you sure you wish to permanently delete this submission?'=>'Вы уверены, что хотите навсегда удалить это сообщение?','Check out our other free wordpress.org plugins!'=>'Ознакомьтесь с другими нашими бесплатными wordpress.org плагины!','Hummingbird Page Speed Optimization'=>'Оптимизация скорости страницы Hummingbird','Performance Tests, File Optimization & Compression, Page, Browser  & Gravatar Caching, GZIP Compression, CloudFlare Integration & more.'=>'Тесты производительности, оптимизация и сжатие файлов, кэширование страниц, браузера и Gravatar, сжатие GZIP, интеграция с CloudFlare и многое другое.','Defender Security, Monitoring, and Hack Protection'=>'Безопасность, мониторинг и защита от взлома Defender','Security Tweaks & Recommendations, File & Malware Scanning, Login & 404 Lockout Protection, Two-Factor Authentication & more.'=>'Настройки безопасности и рекомендации, сканирование файлов и вредоносных программ, защита от входа и блокировки 404, двухфакторная аутентификация и многое другое.','Customize Titles & Meta Data, OpenGraph, Twitter & Pinterest Support, Auto-Keyword Linking, SEO & Readability Analysis, Sitemaps, URL Crawler & more.'=>'Настройка заголовков и метаданных, поддержка OpenGraph, Twitter и Pinterest, автоматическая привязка ключевых слов, анализ SEO и читаемости, Карты сайтов, поиск URL-адресов и многое другое.','Pretty much everything you need for developing and managing WordPress based websites, and then some.'=>'Практически все, что вам нужно для разработки и управления веб-сайтами на базе WordPress, и даже немного больше.','Create any type of form from one of our pre-made templates, or build your own from scratch.'=>'Создайте любой тип формы на основе одного из наших готовых шаблонов или создайте свой собственный с нуля.','Form Submissions'=>'Отправка формуляров','Poll Submissions'=>'Материалы для опросов','Quiz Submissions'=>'Материалы для викторины','Choose how you want to handle the forms data storage.'=>'Выберите, как вы хотите обрабатывать хранилище данных форм.','How long do you want to retain the form submissions for?'=>'Как долго вы хотите сохранять отправленные формы?','Choose how long to retain IP address before a submission is anonymized.'=>'Выберите, как долго сохранять IP-адрес, прежде чем отправка будет анонимизирована.','Retain Submission'=>'Сохранить представление','Remove Submission'=>'Удалить отправку','Choose how you want to handle the polls data storage.'=>'Выберите, как вы хотите обрабатывать хранилище данных опросов.','Choose the default sender name and sender email address for all of your outgoing emails from Forminator.'=>'Выберите имя отправителя по умолчанию и адрес электронной почты отправителя для всех ваших исходящих писем из Forminator.','Enter email'=>'Введите адрес электронной почты','The sender email cannot be empty.'=>'Адрес электронной почты отправителя не может быть пустым.','By default, we\'ll show the CAPTCHA in your website\'s language.'=>'По умолчанию мы будем показывать КАПЧУ на языке вашего сайта.','Captcha settings'=>'Настройки Captcha','%1$s (%2$s) vote'=>'%1$s (%2$s) голосов' . "\0" . '%1$s (%2$s) голосов' . "\0" . '%1$s (%2$s) голосов','reCAPTCHA Preview'=>'reCAPTCHA Предварительный просмотр','Ascending'=>'По возрастанию','Descending'=>'По убыванию','More options'=>'Еще настройки','Add Rule'=>'Добавить правило','Archive'=>'Архив','Audio'=>'Аудио','Community'=>'Сообщество','Conditions'=>'Условия','Contains'=>'Содержит','Data'=>'Данные','Data Storage'=>'Хранение данных','Documents'=>'Документы','Download CSV'=>'Скачать CSV','E.g. form-field'=>'Например, поле формы','Enter a name'=>'Введите имя','Enter message'=>'Введите сообщение','Error message'=>'Сообщение об ошибке','Field'=>'Поле','Field Descrip