u have entered exceeds what your current hosting settings are capped to. You need to increase your max filesize limit at the server level first.'=>'Размер файла, который вы ввели, превышает тот, который ограничен вашими текущими настройками хостинга. Сначала вам необходимо увеличить максимальный размер файла на уровне сервера.','Give your form a name'=>'Дайте вашей форме имя','Fetching integration list…'=>'Выборка списка интеграции…','You need to save this form before using integrations.'=>'Вам необходимо сохранить эту форму перед использованием интеграции.','TRY AGAIN'=>'ПОПРОБУЙ ЕЩЕ РАЗ','Width'=>'Ширина','From'=>'От кого','To'=>'До','Featured Image'=>'Изображение записи','Dark'=>'Тёмная','post'=>'запись','Enter label'=>'Введите этикетку','Enter step label'=>'Введите этикетку шага','Saved'=>'Сохранено','Today'=>'Сегодня','Edit Field'=>'Изменить поле','Character limit'=>'Ограничение по количеству символов','Enter subtitle'=>'Введите подзаголовок','Limits'=>'Ограничения','Post type'=>'Тип записи','Saving...'=>'Сохранение...','Single'=>'Отдельно',0=>'0','Afrikaans'=>'Африкаанс','Amharic'=>'Амхарский','Arabic'=>'Арабский','Armenian'=>'Армянский','Azerbaijani'=>'Азербайджанский','Background color'=>'Цвет фона','Bengali'=>'Бенгальский','Bulgarian'=>'Болгарский','Button'=>'Кнопка','Calendar'=>'Календарь','Catalan'=>'Каталонский','Chinese (Hong Kong)'=>'Китайский (Гонконг)','Chinese (Simplified)'=>'Китайский (упрощенный)','Compact'=>'Компактный','Croatian'=>'Хорватский','Current'=>'Текущий','Czech'=>'Чешский','Danish'=>'Датский','Dropdown List'=>'Выпадающий список','Dropdown Search'=>'Выпадающий поиск','Dutch'=>'Голландский','Element'=>'Элемент','English (UK)'=>'Английский (Великобритания)','English (US)'=>'Английский (США)','Enter text'=>'Введите текст','Error Message'=>'Сообщение об ошибке','Estonian'=>'Эстонский','Filipino'=>'Филиппинский','Finnish'=>'Финский','Flat'=>'Плоский','Fonts'=>'Шрифты','French'=>'Французский','Galician'=>'Галисийский','Georgian'=>'Грузинский'