иденциальности можно ознакомиться здесь : https://policies.google.com/privacy?hl=en.','We use Mailchimp to manage our subscriber list. Their privacy policy can be found here : https://mailchimp.com/legal/privacy/.'=>'Мы используем Mailchimp для управления списком абонентов. С их политикой конфиденциальности можно ознакомиться здесь : https://mailchimp.com/legal/privacy/.','We use Trello to manage our integration data. Their privacy policy can be found here : https://trello.com/privacy.'=>'Мы используем Trello для управления нашими интеграционными данными. С их политикой конфиденциальности можно ознакомиться здесь: https://trello.com/privacy.','When visitors or users submit a form, we capture the <strong>IP Address</strong> for spam protection. We also capture the <strong>email address</strong> and might capture other personal data included in the Form fields.'=>'Когда посетители или пользователи отправляют форму, мы захватываем <strong>IP-адрес</strong> для защиты от спама. Мы также захватываем <strong>адрес электронной почты</strong> и можем захватить другие личные данные, включенные в поля формы.','When visitors or users submit a poll, we capture the <strong>IP Address</strong> for spam protection and to set voter limitations.'=>'Когда посетители или пользователи отправляют опрос, мы захватываем <strong>IP-адрес</strong> для защиты от спама и установки ограничений для избирателей.','When visitors or users votes on a poll we retain the <strong>IP Address</strong> data for 30 days and anonymize it.'=>'Когда посетители или пользователи голосуют по опросу, мы сохраняем данные <strong>IP-адреса</strong> в течение 30 дней и анонимизируем их.','You have already voted for this poll.'=>'Вы уже проголосовали за этот опрос.','You haven\'t answered any questions'=>'Вы не ответили ни на один вопрос','You need to select a poll option'=>'Вам нужно выбрать опцию опроса','Your vote has been saved'=>'Ваш голос был сохранен','Fields Description'=>'Описание полей','Showing %$1s of %$2s fields'=>'Отображение %$1s полей %$2s','WPMU DEV'=>'Разработчик WPMU','Input and Textarea'=>'Ввод и текстовое поле','Main background'=>'Основная предыстория','Container border'=>'Граница контейнера','Option color'=>'Цвет опции','For more advanced customization options use custom CSS.'=>'Для более продвинутых вариантов настройки используйте пользовательский CSS.','Section Subtitle'=>'Подзаголовок раздела','Upload Button'=>'Кнопка Загрузки','Form does not have fields that can be autofilled.'=>'Форма не содержит полей, которые можно было бы автоматически заполнить.','Editable'=>'Редактируемый','Select day'=>'Выберите день','Whoops! This form has expired.'=>'Упс! Срок действия этой формы истек.','Add some custom message for users to see when your form stops appearing or leave empty to show nothing (just an empty space).'=>'Добавьте какое-нибудь пользовательское сообщение, чтобы пользователи могли видеть, когда ваша форма перестанет появляться, или оставьте пустым, чтобы ничего не показывать (просто пустое место).','Submission Behavior'=>'Поведение подчинения','Calendar Icon'=>'Значок календаря','Recipient(s)'=>'Получатель(ы)','Reply-to Email'=>'Ответ-на электронную почту','Reply To Address'=>'Ответ на адрес','BCC Addresses'=>'Адреса BCC','Description color'=>'Описание цвет','Submission Method'=>'Способ отправки','E.g. Vote'=>'Например, Голосование','Quiz Title'=>'Название викторины','Form entry saved'=>'Сохраненная запись в форме','Select Poll'=>'Выберите Опрос','Select Quiz'=>'Выберите Тест','Only logged in users can submit this %s.'=>'Только зарегистрированные пользователи могут отправлять эти %s.','Pagination selectors'=>'Селекторы разбивки на страницы','Thank you for contacting us, we will be in touch shortly.'=>'Спасибо, что обратились к нам, мы свяжемся с вами в ближайшее время.','Enter your message...'=>'Введите свое сообщение...','There was an error saving the post data. Please try again'=>'Произошла ошибка при сохранении данных post. Попробуйте еще раз','Entry ID'=>'Идентификатор входа','Submission Date'=>'Дата подачи заявки','Which forms collect personal data?'=>'Какие формы собирают персональные данные?','If you use Forminator PRO to create and embed any forms on your website, you may need to mention it here to properly distinguish it from other forms.'=>'Если вы используете Forminator PRO для создания и встраивания каких-либо форм на свой веб-сайт, вам может потребоваться упомянуть об этом здесь, чтобы правильно отличить его от других форм.','What personal data do we collect and why?'=>'Какие персональные данные мы собираем и почему?','When visitors or users submit a form we retain the data for 30 days.'=>'Когда посетители или пользователи отправляют форму, мы сохраняем данные в течение 30 дней.','All collected data might be shown publicly and we send it to our workers or contractors to perform necessary actions based on the form submission.'=>'Все собранные данные могут быть показаны публично, и мы отправляем их нашим работникам или подрядчикам для выполнения необходимых действий на основе отправленной формы.','Third Parties'=>'Третьи стороны','If your forms utilize either built-in or external third party services, in this section you should mention any third parties and its privacy policy.'=>'Если ваши формы используют встроенные или внешние сторонние сервисы, в этом разделе вы должны упомянуть любые третьи стороны и их политику конфиденциальности.','Note: In this section you should include any personal data you collected and which form captures personal data to give users more relevant information. You should also include an explanation of why this data is needed. The explanation must note either the legal basis for your data collection and retention of the active consent the user has given.'=>'Примечание: В этом разделе вы должны указать любые персональные данные, которые вы собрали, и какая форма фиксирует персональные данные, чтобы предоставить пользователям более актуальную информацию. Вы также должны включить объяснение того, зачем нужны эти данные. В объяснении должно быть указано либо юридическое основание для сбора ваших данных, либо сохранение активного согласия, данного пользователем.','Suggested text: '=>'Предлагаемый текст: ','Google reCAPTCHA. Enabled when you added reCAPTCHA on your forms.'=>'Google reCAPTCHA. Включено, когда вы добавили reCAPTCHA в свои формы.','Mailchimp. Enabled when you activated and set up Mailchimp on Integrations settings.'=>'Почтовый шимпанзе. Включено, когда вы активировали и настроили Mailchimp в настройках интеграции.','View Poll'=>'Просмотр опроса','Poll results behavior'=>'Поведение результатов опроса','Poll results style'=>'Стиль результатов опроса','Enable AJAX to prevent refresh while submitting poll data.'=>'Включите AJAX, чтобы предотвратить обновление при отправке данных опроса.','Poll votes count'=>'Подсчет голосов в ходе опроса','Enable this option to display number of votes on Bar Chart results.'=>'Включите эту опцию для отображения количества голосов в результатах гистограммы.','Poll votes limit'=>'Лимит голосов в опросе','Allow same visitor to vote more than once'=>'Разрешить одному и тому же посетителю голосовать более одного раза','How long before user can vote again'=>'Сколько времени пройдет, прежде чем пользователь сможет проголосовать снова','Choose a pre-made style for your poll and further customize it\'s appearance'=>'Выберите готовый стиль для своего опроса и дополнительно настройте его внешний вид','Customize poll container'=>'Настройка контейнера опроса','Add box shadow to your poll container'=>'Добавьте тень поля в контейнер опроса','Poll container'=>'Контейнер для опроса','Custom answer'=>'Пользовательский ответ','Enter poll answer'=>'Введите ответ на опрос','Custom input placeholder'=>'Пользовательский заполнитель ввода','Type placeholder here...'=>'Введите заполнитель здесь...','Enter question title'=>'Введите название вопроса','Form name cannot be empty! Please pick a name for your poll.'=>'Имя формы не может быть пустым! Пожалуйста, выберите название для вашего опроса.','Poll question cannot be empty! Please add questions for your poll.'=>'Вопрос опроса не может быть пустым! Пожалуйста, добавляйте вопросы для вашего опроса.','This name won\'t be displayed on your poll, but will help you to identify it.'=>'Это имя не будет отображаться в вашем опросе, но поможет вам идентифицировать его.','This is the question you will be asking to users.'=>'Это вопрос, который вы будете задавать пользователям.','Button styles'=>'Стили кнопок','Results link (hover)'=>'Ссылка на результаты (наведение курсора мыши)','Results link (active)'=>'Ссылка на результаты (активная)','You have already submitted a vote to this poll'=>'Вы уже подали свой голос на этот опрос','View results'=>'Просмотр результатов','Back To Poll'=>'Вернемся к опросу','Which polls are collecting personal data?'=>'Какие опросы собирают персональные данные?','If you use Forminator PRO to create and embed any polls on your website, you may need to mention it here to properly distinguish it from other polls.'=>'Если вы используете Forminator PRO для создания и встраивания любых опросов на свой веб-сайт, вам может потребоваться упомянуть об этом здесь, чтобы правильно отличить его от других опросов.','All collected data might be shown publicly and we send it to our workers or contractors to perform necessary actions based on votes.'=>'Все собранные данные могут быть показаны публично, и мы отправляем их нашим работникам или подрядчикам для выполнения необходимых действий на основе голосов.','If your polls utilize either built-in or external third party services, in this section you should mention any third parties and its privacy policy.'=>'Если в ваших опросах используются встроенные или внешние сторонние сервисы, в этом разделе вы должны указать любые третьи стороны и их политику конфиденциальности.','In this section you should note what personal data you collected including which polls are available. You should also explan why this data is needed. Include the legal basis for your data collection and note the active consent the user has given.'=>'В этом разделе вы должны указать, какие персональные данные вы собрали, в том числе какие опросы доступны. Вы также должны объяснить, зачем нужны эти данные. Укажите правовую основу для сбора ваших данных и обратите внимание на активное согласие, данное пользователем.','New Quiz'=>'Новая Викторина','Further customize the appearance for quiz title. It appears as result\'s header.'=>'Далее настройте внешний вид названия викторины. Он отображается в качестве заголовка результата.','Further customize appearance for quiz title.'=>'Далее настройте внешний вид названия викторины.','Further customize appearance for quiz featured image.'=>'Далее настройте внешний вид для изображения, показанного в викторине.','Further customize appearance for quiz description / intro.'=>'Далее настройте внешний вид для описания / введения викторины.','Description / Intro'=>'Описание / Вступление','Pick if you want to reveal the correct answer as user finishes question, or only after the whole quiz is completed.'=>'Выберите, хотите ли вы показать правильный ответ, когда пользователь закончит задавать вопрос, или только после завершения всего теста.','When to reveal correct answer'=>'Когда показывать правильный ответ','Further customize appearance for answer message.'=>'Далее настройте внешний вид ответного сообщения.','Correct answer message'=>'Сообщение с правильным ответом','Incorrect answer message'=>'Сообщение о неправильном ответе','Final count message'=>'Сообщение об окончательном подсчете','You can now add some html content here to personalize even more text displayed as Final Count Message. Try it now!'=>'Теперь вы можете добавить сюда некоторый HTML-контент, чтобы персонализировать еще больше текста, отображаемого в качестве сообщения об окончательном подсчете. Попробуйте прямо сейчас!','Quizzes can have even number of scores for 2 or more results, in those scenarios, this order will help determine the result.'=>'Тесты могут иметь четное количество баллов за 2 или более результатов, в этих сценариях этот порядок поможет определить результат.','Further customize appearance for quiz questions.'=>'Дополнительно настройте внешний вид для вопросов викторины.','Result title'=>'Заголовок результата','Further customize the appearance for result description typography.'=>'Далее настройте внешний вид для типографики описания результата.','Further customize the appearance for result title typography.'=>'Далее настройте внешний вид для типографики заголовка результата.','Retake button'=>'Кнопка Пересдачи','Further customize the appearance for retake quiz button.'=>'Далее настройте внешний вид кнопки "пересдать тест".','Form name cannot be empty! Please pick a name for your quiz.'=>'Имя формы не может быть пустым! Пожалуйста, выберите название для вашего теста.','Quiz question cannot be empty! Please add questions for your quiz.'=>'Вопрос викторины не может быть пустым! Пожалуйста, добавляйте вопросы для вашего теста.','Quiz answers cannot be empty! Please add some questions.'=>'Ответы на викторины не могут быть пустыми! Пожалуйста, добавьте несколько вопросов.','Result answer cannot be empty! Please select a result.'=>'Результат ответа не может быть пустым! Пожалуйста, выберите результат.','This question needs a correct answer. Please, select one before saving or proceeding to next step.'=>'На этот вопрос нужен правильный ответ. Пожалуйста, выберите один из них, прежде чем сохранять или переходить к следующему шагу.','You don\'t have any answer for this question yet.'=>'У вас пока нет никакого ответа на этот вопрос.','Further customize appearance for quiz answers.'=>'Дополнительно настройте внешний вид ответов на вопросы викторины.','Customize appearance for correct answers.'=>'Настройте внешний вид для правильных ответов.','Further customize appearance for quiz submit button.'=>'Дополнительно настройте внешний вид кнопки отп