ация с Монитором кампании','Sent To Campaign Monitor'=>'Отправлено в Campaign Monitor','Data sent to Campaign Monitor'=>'Данные, отправленные в Campaign Monitor','Data received from Campaign Monitor'=>'Данные, полученные от Campaign Monitor','Campaign Monitor Info'=>'Информация о мониторинге кампании','No lists found on your Campaign Monitor. Please create one.'=>'Списки не найдены на мониторе вашей кампании. Пожалуйста, создайте его.','Campaign Monitor list\'s custom fields could not be found'=>'Не удалось найти настраиваемые поля списка мониторинга кампании','Please pick valid Consent To Track options'=>'Пожалуйста, выберите действительное согласие Для отслеживания параметров','Invalid Form Settings of Campaign Monitor'=>'Неверные настройки формы монитора кампании','No active Campaign Monitor connection found in this form'=>'В этой форме не найдено активного подключения к монитору кампании','Could not find client details, please try again'=>'Не удалось найти данные клиента, пожалуйста, повторите попытку','Please put a valid Campaign Monitor API Key'=>'Пожалуйста, укажите действительный ключ API Campaign Monitor','Failed to process request, make sure your Webhook URL is correct and your server has internet connection.'=>'Не удалось обработать запрос, убедитесь, что ваш URL-адрес Webhook указан правильно и ваш сервер подключен к Интернету.','Match up your form fields with your Campaign Monitor fields to make sure we\'re sending data to the right place.'=>'Сопоставьте поля вашей формы с полями монитора кампании, чтобы убедиться, что мы отправляем данные в нужное место.','Campaign Monitor Field'=>'Поле Мониторинга кампании','Pick Campaign Monitor List for new subscriber to be added to.'=>'Выберите список мониторинга кампании для добавления нового подписчика.','Configure additional options for Campaign Monitor integration.'=>'Настройте дополнительные параметры для интеграции с Campaign Monitor.','Re-subscribe'=>'Повторная подписка','If the subscriber is in an inactive 